INSERT INTO `mc_faq_langs` (`id`, `faq_id`, `lang_id`, `question`, `answer`, `status`) VALUES
(1, 6, 1, 'How do I know if a merchant offers good service?', '&lt;span style=&quot;font-size:11.0pt;line-height:115%;\r\nfont-family:&amp;quot;Cambria&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;mso-font-kerning:18.0pt;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&quot;&gt;There is a column for Hoppay Merchant Ratings on every product page. The Merchant Ratings allow you to rate any merchant on our site and post a short comment about your experience with them.&lt;/span&gt;&amp;nbsp;', 1),
(2, 7, 1, 'How do I search for an item on  Hoppay?', '&amp;nbsp;&lt;span style=&quot;font-size:11.0pt;line-height:115%;\r\nfont-family:&amp;quot;Cambria&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;mso-font-kerning:18.0pt;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&quot;&gt;Type the name of the product you would like to purchase in the search bar on the&amp;nbsp; Hoppay.com Homepage and click ''SEARCH''. If the product you are searching for is being sold by any of the vendors listed on&amp;nbsp; Hoppay, we will display the related results. If you know exactly what you''re looking for, you can enter the manufacturer part number or keywords into the search box to go directly to the product. Select a product channel from the dropdown menu to narrow your search results, or leave it on &amp;quot;All Products&amp;quot; to make your search broader. If you have specific questions regarding a product please contact the seller with whom you would like to do business directly as they will be better suited to assist you with your order. If you would like to contact a merchant simply click on the merchant''s name and you will be redirected to their website, where you can find their contact information. If the vendor you wish to buy from is a&amp;nbsp; Hoppay Storefronts seller, you will need to click the &amp;lsquo;SEE IT&amp;rsquo; button next to their name then the &amp;lsquo;Ask seller a question&amp;rsquo; link within their&amp;nbsp; Hoppay Storefront to establish communication.&lt;/span&gt;', 1);
