(5, 3, 1, 'Welcome to our Merchant Center', '&lt;h2&gt;Not Only Do We Drive Traffic, We Drive Shoppers!&amp;nbsp;&lt;br /&gt;\r\n&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Simplicity and utility at your fingertips!&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;', '[{&quot;slug&quot;:&quot;inner_points&quot;,&quot;key&quot;:&quot;Intuitive Feed for Quick and Easy Upload&quot;,&quot;subtitle&quot;:&quot;Painless onboarding so you can focus on capturing sales traffic&quot;,&quot;values&quot;:&quot;We make it easy for you to get up and running as quickly as possible. With zero setup fees, there is no risk for you to participate. Spend less time trying to register, and more time developing sales.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/mr_3.jpg&quot;},{&quot;slug&quot;:&quot;inner_points&quot;,&quot;key&quot;:&quot;Store Management When You Need It&quot;,&quot;subtitle&quot;:&quot;Flexibility to manage store and products from anywhere, anytime&quot;,&quot;values&quot;:&quot;By joining Hoppay, you can manage your entire store and product listing with just a few clicks. Once you decide which products and brands you want to display, you can then easily track activity such as product search, visits, and sales.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/113024mr_1.png&quot;},{&quot;slug&quot;:&quot;inner_points&quot;,&quot;key&quot;:&quot;Platform That Attracts Qualified Leads&quot;,&quot;subtitle&quot;:&quot;Driving only the most relevant shoppers from across the Middle East&quot;,&quot;values&quot;:&quot;By listing your products as a vendor, you will be able to reach your intended target audience effectively, promote offers to attract qualified shoppers efficiently, and generate traffic to your store economically.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/mr_2.jpg&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Setup is Simple and Easy&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-06.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Grow Your Customer Base&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-13.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Reach Ready-To-Buy Shoppers&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-20.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Pitch To Your Exact Target Audience&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-25.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Increased Visibility and Exposure&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-33.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Drive Additional Traffic&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Combine high revenue with low cost of sales&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-11.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Risk Free!&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-17.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Channel for High Conversion Rate&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-28.png&quot;},{&quot;slug&quot;:&quot;tagline&quot;,&quot;key&quot;:&quot;Enjoy High Return On Investment&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/merchant_06-36.png&quot;},{&quot;slug&quot;:&quot;inner_points&quot;,&quot;key&quot;:&quot; Enhance Your Business Service And Understand Your Customer Need&quot;,&quot;subtitle&quot;:&quot;Know the market trends&quot;,&quot;values&quot;:&quot;We provide extensive optimization tools and commerce solutions to help you understand customer needs, enhance your business services, and understand market trends.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/1335313-Proven-Ways-to-Increase-Website-Traffic.jpg&quot;}]', 'overview', 'overview', 1),
(6, 4, 1, 'Attract new customers and build a following', 'Our Comparison Shopping Engine is highly effective advertising channel that help online retailers to direct millions of pre-qualified, ready to buy shoppers to online stores participating in our program.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhen shoppers search for an item, Hoppay shows them what your offer and guide them to your store to complete purchase.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou need to list your item and tell us about it by submitting bulk upload file containing information about each item.&amp;nbsp;The more information you include about your item, the more shoppers will be interested in buying it.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur feedback program assists online retailers in listening to their customers and starts a dialogue with them to grow customer loyalty.', '[{&quot;slug&quot;:&quot;howitwork_inner&quot;,&quot;key&quot;:&quot;Create an account on Hoppay&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;Hoppay provides quick registration to setup a merchant account where you can have an overview of all the activities and manage your product listing and ads easily.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/053446stpeping1.jpg&quot;},{&quot;slug&quot;:&quot;howitwork_inner&quot;,&quot;key&quot;:&quot;Upload you product catalog on Hoppay&quot;,&quot;subtitle&quot;:&quot;Shoppers buy at your store&quot;,&quot;values&quot;:&quot;Hoppay provides product listing solutions for merchants of all sizes. You can upload your products catalog via FTP or through API or Crawling methods. &quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/053446stpeping2.jpg&quot;},{&quot;slug&quot;:&quot;howitwork_inner&quot;,&quot;key&quot;:&quot;Shoppers see your Ads on Hoppay&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;Once you have uploaded your product catalog, we will create ads for your products and offers using the information provided in your product file. Your ads will go live and will be available to the customers to view the product details.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/104636stpeping3.jpg&quot;},{&quot;slug&quot;:&quot;howitwork_inner&quot;,&quot;key&quot;:&quot;Shoppers click on the Ads to visit your store&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;When shoppers search for an item, Hoppay shows them what your offer and guide them to your store to complete purchase.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/104636stpeping4.jpg&quot;},{&quot;slug&quot;:&quot;howitwork_inner&quot;,&quot;key&quot;:&quot;Shoppers buy at your store&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;Shoppers will be guided and directed to your store, You control branding and purchase experience on your website. Customer who purchase from you become directly your customer base.&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/125059stpeping5.png&quot;},{&quot;slug&quot;:&quot;video_link&quot;,&quot;key&quot;:&quot;&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:&quot;uploads\\/page\\/attr\\/123944How-it-woks-[Converted].png&quot;}]', 'how it works', 'how it works', 1),
(7, 5, 1, 'Data Feed Requirements', '&amp;nbsp;Hoppay &lt;span style=&quot;color: rgb(18, 20, 24); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20px; text-align: center;&quot;&gt;shopping partners are leading providers of data management &amp;amp; ecommerce solutions who can assist you with building and submitting your product data feeds to Hoppay Shopping. With the help of an approved partner, you can manage your products, making it easier to drive traffic and sales to your online store.&lt;/span&gt;', '[{"slug":"","key":"","subtitle":"","values":""}]', 'Data feed', 'Data feed', 1),
(8, 6, 1, 'Menacompare Merchant Partner', '&lt;h1 style=&quot;text-align:center&quot;&gt;Coming Soon&lt;/h1&gt;', NULL, NULL, NULL, 1),
(9, 7, 1, 'Coming Soon', '&lt;h1 style=&quot;text-align: center;&quot;&gt;Coming Soon&lt;/h1&gt;', NULL, NULL, NULL, 1),
(10, 8, 1, 'Frequently Asked Questions', '&amp;nbsp;&lt;span style=&quot;color: rgb(18, 20, 24); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20px; text-align: center;&quot;&gt;These FAQs are designed to provide a better understanding of Creative Commons, our licenses, and our other legal and technical tools. They provide basic information, sometimes about fairly complex topics, and will often link to more detailed information. store.&lt;/span&gt;', '[{"slug":"","key":"","subtitle":"","values":""}]', 'FAQ', 'FAQ', 1),
