(21, 17, 1, 'Sign up', '&lt;h1&gt;Your privacy is important to us&lt;/h1&gt;\r\n&lt;h3&gt;Hoppay does not rent or sell your personal information to third parties without your consent. To learn more, read our privacy policy.&lt;/h3&gt;\r\n&lt;h3&gt;Provide correct contact details as your trading partners may want to get in touch with you. Incorrect or incomplete contact information can lead to account suspension.&lt;/h3&gt;\r\n&lt;ul class=&quot;signUpList&quot;&gt;\r\n    &lt;li&gt;Save your favorite item&lt;/li&gt;\r\n    &lt;li&gt;Receive product recommendations&lt;/li&gt;\r\n    &lt;li&gt;Get access to exclusive coupons&lt;/li&gt;\r\n    &lt;li&gt;Gain entries to contests&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;div class=&quot;clear&quot; style=&quot;height:10px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;h3&gt;By providing your e-mail address, you agree to receive information about products, services and offers from Hoppay.&lt;/h3&gt;', '[{&quot;slug&quot;:&quot;&quot;,&quot;key&quot;:&quot;&quot;,&quot;subtitle&quot;:&quot;&quot;,&quot;values&quot;:&quot;&quot;,&quot;img&quot;:null}]', '', '', 1);
