(2497, 999, 1, 'Apple MacBook Pro With Retina Display ME866 Laptop (13 Inch, 2.6 GHz Dual Core Intel i5, OS X Mavericks, HDD 512 GB, 8 GB, Silver)', 'Description of Apple MacBook Pro With Retina Display ME866 Laptop (13 Inch, 2.6 GHz Dual Core Intel i5, OS X Mavericks, HDD 512 GB, 8 GB, Silver) The Apple MacBook Pro surpasses all its previous generation MacBooks in terms of display and computing. With its advanced 13.3 Inch Retina Display you get 4 times sharper and crisper picture delivery. The MacBook Pro can process complex tasks in a matter of seconds with its 2.6GHz Dual Core Intel i5 processor. This gives you enough computing power to handle apps, games and daily tasks. Moreover, its 8GB RAM assures incredible multitasking efficiency to the user. The OS X Maverick provides a systematic integration between iOS and OS X. It lets you seamlessly sync apps like Calendar, iBook, Safari, and Maps between MAC and iOS devices. The 512GB HDD provides adequate storage space, which can be further expanded with the USB and Thunderbolt ports.\nMost advanced notebook Most advanced notebook so far.\n\nThe Apple Mac Book Pro beautifully embeds cutting edge technology in a slim design. It employs the revolutionary Retina Display that includes 4 times the pixels in the same space as the older version.\nRetina Display\nThe Retina display gives you stunning display with its multimillion pixel view. The 13.3 inch model has a pixel density greater than 4 million, which is so high that it cannot be seen with naked eyes.\nIncredible power with Quad core\nThe 13.3 inch MacBook Pro with Retina Display employs the powerful latest generation dual core Intel core i5 processors. ', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;color&quot;:&quot;Silver&quot;,&quot;Screen Size&quot;:&quot;13.3 Inch&quot;,&quot;Operating System&quot;:&quot;OS X Mavericks&quot;,&quot;Monitor type&quot;:&quot; Retina Display with IPS&quot;,&quot;Battery type&quot;:&quot;Lithium Polymer &quot;,&quot;Display Resolution&quot;:&quot;2560 x 1600&quot;,&quot;Storage Capacity&quot;:&quot; 512 GB&quot;,&quot;Maximum Cutting Depth&quot;:&quot;218.948 mm&quot;,&quot;Processor Type&quot;:&quot; Intel Core i5&quot;,&quot;Wireless LAN Type&quot;:&quot;IEEE 802.11a\\/b\\/g\\/n&quot;,&quot;Memory Type&quot;:&quot; DDR3L&quot;,&quot;Memory Card Slot&quot;:&quot;SDXC&quot;,&quot;Graphics adapter manufacturer&quot;:&quot;Intel Iris Pro&quot;,&quot;Display Size (cm)&quot;:&quot;33.782 cm&quot;,&quot;Memory Size&quot;:&quot;8 GB&quot;,&quot;CPU Speed&quot;:&quot;2.6 Ghz&quot;,&quot;Megapixel&quot;:&quot;720 pixel HD&quot;,&quot;Hard Disk Capacity&quot;:&quot;512 GB&quot;}', NULL, 1),
(2498, 999, 2, 'Apple MacBook Pro With Retina Display ME866 Laptop (13 Inch, 2.6 GHz Dual Core Intel i5, OS X Mavericks, HDD 512 GB, 8 GB, Silver)', 'Description of Apple MacBook Pro With Retina Display ME866 Laptop (13 Inch, 2.6 GHz Dual Core Intel i5, OS X Mavericks, HDD 512 GB, 8 GB, Silver) The Apple MacBook Pro surpasses all its previous generation MacBooks in terms of display and computing. With its advanced 13.3 Inch Retina Display you get 4 times sharper and crisper picture delivery. The MacBook Pro can process complex tasks in a matter of seconds with its 2.6GHz Dual Core Intel i5 processor. This gives you enough computing power to handle apps, games and daily tasks. Moreover, its 8GB RAM assures incredible multitasking efficiency to the user. The OS X Maverick provides a systematic integration between iOS and OS X. It lets you seamlessly sync apps like Calendar, iBook, Safari, and Maps between MAC and iOS devices. The 512GB HDD provides adequate storage space, which can be further expanded with the USB and Thunderbolt ports.\nMost advanced notebook Most advanced notebook so far.\n\nThe Apple Mac Book Pro beautifully embeds cutting edge technology in a slim design. It employs the revolutionary Retina Display that includes 4 times the pixels in the same space as the older version.\nRetina Display\nThe Retina display gives you stunning display with its multimillion pixel view. The 13.3 inch model has a pixel density greater than 4 million, which is so high that it cannot be seen with naked eyes.\nIncredible power with Quad core\nThe 13.3 inch MacBook Pro with Retina Display employs the powerful latest generation dual core Intel core i5 processors. ', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;color&quot;:&quot;Silver&quot;,&quot;Screen Size&quot;:&quot;13.3 Inch&quot;,&quot;Operating System&quot;:&quot;OS X Mavericks&quot;,&quot;Monitor type&quot;:&quot; Retina Display with IPS&quot;,&quot;Battery type&quot;:&quot;Lithium Polymer &quot;,&quot;Display Resolut