(2499, 1000, 1, 'Apple MacBook Pro With Retina Display ME865 Laptop (13 Inch, 2.4 GHz Dual Core Intel i5, OS X Mavericks, HDD 256 GB, 8 GB, Silver)', 'The Apple MacBook Pro perfectly blends state of art technology in its sleek design. Its advanced 13.3 Inch Retina display assures sharper and crisper display. The MacBook is powered by a 2.4GHz Dual Core Intel i5 processor which provides high computing power to the device. The processor is built to handle complex computing tasks and create results in no time. The MacBook Pro comes with OS X Mavericks to provides you an improved iCloud service, better security, enhanced features of Safari, iCloud Keychain and many other great features. The MacBook performance is improved with its built in 8GB RAM, which assures improved system responsiveness and multitasking capabilities. With its 256GB HDD, you can easily store important documents, music and pictures.\nMost advanced notebook so far\n\nThe Apple Mac Book Pro beautifully embeds cutting edge technology in a slim design.\nRetina Display\nThe Retina display gives you stunning display with its multimillion pixel view. \nIncredible power with Dual Core\nThe 13.3 inch MacBook Pro with Retina Display employs the powerful latest generation dual core Intel core i5 processors.\nExceptional onscreen performance with Iris and Iris Pro Graphics\nThe MacBook Pro has Intel Iris Graphics which amazingly enhance the graphic performance up to 90% .', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;color&quot;:&quot;Silver&quot;,&quot;Screen Size&quot;:&quot;13.3 Inch&quot;,&quot;Operating System&quot;:&quot;OS X Mavericks&quot;,&quot;Monitor type&quot;:&quot; Retina Display with IPS&quot;,&quot;Battery type&quot;:&quot;Lithium Polymer &quot;,&quot;Display Resolution&quot;:&quot;2560 x 1600&quot;,&quot;Storage Capacity&quot;:&quot; 512 GB&quot;,&quot;Maximum Cutting Depth&quot;:&quot;218.948 mm&quot;,&quot;Processor Type&quot;:&quot;Intel Core i5&quot;,&quot;Wireless LAN Type&quot;:&quot;IEEE 802.11a\\/b\\/g\\/n&quot;,&quot;Memory Type&quot;:&quot; DDR3L&quot;,&quot;Memory Card Slot&quot;:&quot;SDXC&quot;,&quot;Graphics adapter manufacturer&quot;:&quot;Intel Iris Pro&quot;,&quot;Display Size (cm)&quot;:&quot;33.782 cm&quot;,&quot;Memory Size&quot;:&quot;8 GB&quot;,&quot;CPU Speed&quot;:&quot;2.6 Ghz&quot;,&quot;Megapixel&quot;:&quot;720 pixel HD&quot;,&quot;Hard Disk Capacity&quot;:&quot;256 GB&quot;}', NULL, 1);
