(2501, 1001, 1, 'Samsung Galaxy S4 Mini Dual Sim i9192 (8GB, 3G + WIFI, White)', 'The Galaxy range from Samsung has for quite some time been a rage in the Android market. With the high end Samsung Galaxy S4 mini, it further ups this reputation. Packed with a quad core processor and a whole lot of features, the phone has soon become the fastest selling smartphone in Samsung''s history. Compact and stylish. Big performance. Slip it into your pocket or use it one handed Enjoy smooth and powerful performance Use smart services for health, travel and more Play and share with friends using Group Play .\nMultimedia \nThe Samsung Galaxy S4 mini has a surprisingly powerful speaker with music playback enough to satisfy most casual users. The Samsung Galaxy S4 miniâ€™s home screens can be adorned with a selection of music and video centric widgets, offering instant access to your digital content.\n\nConnectivity \nConnectivity on the Samsung Galaxy S4 mini is well catered for, thanks to simply packing in the finest sensors and connection modules .\nBattery &amp; Storage \nThe Samsung Galaxy S4 mini features a 2600mAh battery that delivers up to 9 hours of talk time on a 3G network.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;color&quot;:&quot;White&quot;,&quot;Memory Size&quot;:&quot;8&quot;,&quot;Operating System&quot;:&quot;Android OS, v4.2.2 (Jelly Bean)&quot;,&quot;Resolution&quot;:&quot;540 x 960&quot;,&quot;Storage Capacity&quot;:&quot;8GB&quot;,&quot;Maximum Cutting Depth&quot;:&quot;8.3 mm&quot;,&quot;Package weight&quot;:&quot;168 gram&quot;,&quot;Processor Type&quot;:&quot;Qualcomm Snapdragon 800&quot;,&quot;CPU&quot;:&quot;Dual core&quot;,&quot;Horizontal resolution&quot;:&quot;1920 Pixel&quot;,&quot;RAM Memory&quot;:&quot;3 GB&quot;,&quot;Wireless Connections&quot;:&quot;802.11a\\/b\\/g\\/n\\/ac&quot;,&quot;Standby time&quot;:&quot;Up to 490 Hours Standby Time (W-CDMA)&quot;,&quot;Phone camera&quot;:&quot;13 Megapixel&quot;,&quot;Second camera&quot;:&quot;Front Camera 2 Megapixels&quot;}', NULL, 1),
