(2505, 1003, 1, 'Apple iPad Mini (7.9 Inch, 64 GB, iOS6, 4G LTE + Wi-Fi , Black)', 'Just as amazing as before The incredible iPad mini comes with the all new technology. It embeds a host of new features like the new A5 chip, advanced wireless and powerful apps that are beautifully integrated with the iOS 7 operating system. It has advantages of its sibling, the iPad Air but is super-portable and easily fits in one hand with its right size.\n\nThin and light. To fit more in your hand\nThe iPad mini is fully packed with loads of incredible new features. It has a stunning display, the incredibly powerful A5 chip, advanced wireless technologies, and much more.\nA5 Chip\nThe A5 chip takes iPad to new heights of power and speed. Due to improved speed apps run faster, and games are more responsive.\n\nSuperfast Wi-Fi\nThe iPad mini offers up to 2x WiFi performance with its two antennas and MIMO (multiple-input multiple-output) technology.\n\nMore LTE bands\nThe iPad mini with Wi-Fi Cellular lets you connect to the Internet while you are on the move. \nReady to work and play\nThe iPad mini is the perfect everyday companion. That is because it comes with apps that help you do the everyday things like check emails, talk over FaceTime (* Facetime may not be available in your country), or consult Siri to settle a bet.', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;color&quot;:&quot;Black&quot;,&quot;Monitor Type&quot;:&quot;TFT display&quot;,&quot;Operating System&quot;:&quot;iPad OS&quot;,&quot;Battery Charging Time&quot;:&quot;10&quot;,&quot;Storage Capacity&quot;:&quot;64 GB&quot;,&quot;Processor Type&quot;:&quot;A5 APPLE&quot;,&quot;Display technology type&quot;:&quot;TFT Display&quot;,&quot;Horizontal resolution&quot;:&quot;1024&quot;,&quot;Touchscreen&quot;:&quot;Multi-touch&quot;,&quot;Display Size (cm)&quot;:&quot;20,07&quot;,&quot;Aspect Ratio&quot;:&quot;4:3&quot;,&quot;Memory Size&quot;:&quot;1024&quot;,&quot;LED Backlight&quot;:&quot;Edge LED&quot;}', NULL, 1),
