(2516, 1008, 2, 'Apple iPad Mini 2 With Retina Display (7.9 Inch, 64 GB, iOS 7.0.3, 4G LTE + Wifi, Space Grey)', 'Super Illuminator 100-meter water resistance 1/10-second chronograph Date display EDIFICE logo stamped on the crown and back cover Genuine leather band *Super Illuminator lights up the dial with high-brightness white LED. Mineral Glass Screw Lock Back 100-meter water resistance Case / bezel material: Stainless steel Genuine Leather Band LED light (Super Illuminator) Afterglow 1/10-second stopwatch Measuring capacity: 59''59.9'''' Measuring modes: Elapsed time, split time, 1st-2nd place times Date display Regular timekeeping: 3 hands (hour, minute, second),\n\n', '{&quot;Brand&quot;:&quot;Casio&quot;,&quot;Band Material&quot;:&quot;Leather&quot;,&quot;Watch Shape&quot;:&quot;Round&quot;,&quot;Display Type&quot;:&quot;Analog&quot;,&quot;Type&quot;:&quot;Casual Watch&quot;}', NULL, 1),
(2517, 1009, 1, 'Samsung Galaxy Gear 2 Smart Watch - Charcoal Black', 'The Samsung Galaxy Gear 2 Smart Watch is a stylish, rugged, computerized wristwatch designed for use with a numerous Samsung smartphones and tablets. The watch instantly notifies you of incoming calls and text messages and lets you make and receive calls or read the messages. It features a built in 2MP camera that lets you click full HD pictures and record 720p videos. Notifications as well as the captured images and videos are displayed in full detail on the 1.63inch Super AMOLED screen of the device. This smartwatch comes installed a personalized fitness manager that tracks and evaluates your workouts with its optical heart sensor. Listening to music while working out pumps up many individuals, making them exercise harder. Samsung Gear 2 comes with a standalone music player that can pair with Bluetooth headsets, letting you listen to your favorite tracks even without your smartphone. This IP67 rated watchâ€™s face is constructed from metal, making it extremely durable. You can customize the display by changing the looks of your dock, wallpapers, and font size as per your wishes. The watch comes with charcoal black straps that can be changed to suit your style.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Band Material&quot;:&quot;Leather&quot;,&quot;Watch Shape&quot;:&quot;Round&quot;,&quot;Display Type&quot;:&quot;Analog&quot;,&quot;Type&quot;:&quot;Casual Watch&quot;}', NULL, 1),
(2518, 1009, 2, 'Apple iPad Mini 2 With Retina Display (7.9 Inch, 64 GB, iOS 7.0.3, 4G LTE + Wifi, Space Grey)', 'The Samsung Galaxy Gear 2 Smart Watch is a stylish, rugged, computerized wristwatch designed for use with a numerous Samsung smartphones and tablets. The watch instantly notifies you of incoming calls and text messages and lets you make and receive calls or read the messages. It features a built in 2MP camera that lets you click full HD pictures and record 720p videos. Notifications as well as the captured images and videos are displayed in full detail on the 1.63inch Super AMOLED screen of the device. This smartwatch comes installed a personalized fitness manager that tracks and evaluates your workouts with its optical heart sensor. Listening to music while working out pumps up many individuals, making them exercise harder. Samsung Gear 2 comes with a standalone music player that can pair with Bluetooth headsets, letting you listen to your favorite tracks even without your smartphone. This IP67 rated watchâ€™s face is constructed from metal, making it extremely durable. You can customize the display by changing the looks of your dock, wallpapers, and font size as per your wishes. The watch comes with charcoal black straps that can be changed to suit your style.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Band Material&quot;:&quot;Leather&quot;,&quot;Watch Shape&quot;:&quot;Round&quot;,&quot;Display Type&quot;:&quot;Analog&quot;,&quot;Type&quot;:&quot;Casual Watch&quot;}', NULL, 1),
(2519, 1010, 1, 'Samsung ST150F (16.2 Megapixel, Digital Still Camera, White)', 'Share your best pictures in style with the ST150. Instantly email or upload high quality photos to your social networks, right from your camera.\n\nInstant Wireless Sharing\n\nInstantly send quality photos to social networks like Facebook or email them to a small group of peopleâ€”directly from the camera. The dedicated DIRECT LINK hot key helps you quickly connect to Wi-Fi networks. Access your uploaded content on supported connected devices.\n\nInstant Saving\n\nSimultaneously send every picture you take to your mobile phone via Wi-Fi connectionâ€”to make backing up and sharing your high-quality photos easy.\n\nCustomize and Edit\n\nEven if you''re not ready for your close-up, you can still create the perfect social network profile picture. Beauty Palette lets you choose from seven different makeup looks that help you change photos instantly.\n\nHybrid Touch Display\n\nThe Hybrid Touch Display offers two options: use the 5-way button to quickly move the cursor and intuitively navigate the menu and make selections. Alternately, when you want to enter text simply input the characters on the touch screen. It couldnâ€™t be easier.', '', NULL, 1),
(2520, 1011, 1, 'Canon EOS 700D 18-55mm Lens Kit ', 'The Canon EOS 700D is a DSLR camera that comes with a huge list of advanced features. Starting with the 18MP Hybrid CMOS AF sensor, this camera can let you shoot high resolution images that can be enlarged and recomposed by cropping without losing detail. This black camera delivers Full HD 1080p video recording that accurately portrays the exact ambiance and emotions of a particular scene. It employs the Hybrid AF technology to ensure that your subject remains in focus continuously, irrespective of the lighting conditions or the movement of the subject. When you want to record videos in complete silence, you can use the Movie Servo AF mode. It works with compatible STM lenses, and ensures that the camera does not make any noise when focusing.\n\n18MP Hybrid CMOS AF Sensor,Full HD 1080p Recording,Fast AF Performance,3 Inch Vari Angle Clear View LCD II Touch Screen Monitor,Touch Screen Control,Scene Intelligent Auto,Creative Photography.', '', NULL, 1),
(2521, 1012, 1, 'Nikon D5100 18-55mm Lens Kit (16.2 Megapixels, DSLR Camera, Black)', 'Explore a new dimension of photography with the Nikon D5100, a high end DLSR camera that comes with loads of features. It features a 16.2MP CMOS sensor that captures even the tiniest details in any scene. Additionally, the EXPEED 2 image processor quickens up the process of images being captured and processed, enabling you to capture Full HD images at high speeds. The innovative Vari Angle LCD monitor swivels away from the camera body, allowing you to easily capture photos from awkward angles such as ground level, waist level, or over the head. The 921,000 dot LCD monitor also enables you to compose your shots accurately, and view all the recorded photos and videos with good detail. The D5100 provides you with a multitude of special effects to choose from. These effects can go a long way in making your photos look more fun and interesting. The 11 point AF system of this camera continuously tracks your subject if it is moving within the frame and ensures that it never loses focus, allowing for razor sharp photos.\n\nCreative Photography,Vari Angle LCD Monitor,Fun and Interesting Effects,Full HD 1080p D Movie with Audio Recording,Stunning Image Quality,High Speed Shooting,Sharp and Precise AF System,Automatic Flash,Compatibility with NIKKOR Lenses.\n\n', '', NULL, 1),
(2522, 1013, 1, 'Nikon D7000 18-105mm Lens Kit (16.2 Megapixel, DSLR Camera, Black)', '&quot;The Nikon D7000 produces high quality output in almost any shooting situation.&quot; &quot;The ''feel'' of the new camera is just amazing; thanks to its heavy-duty magnesium alloy construction.&quot; &quot;Arguably the best high ISO performance of any current APS-C DSLR&quot; The Nikon D7000 is a hit with both professionals and beginner who have much to say about it. The D7000 features a 16.2 MP DX-format CMOS sensor, 6 fps continuous shooting and breathtaking Full 1080p HD movies with full time autofocus at a price you cannot ignore. Use the Nikon D7000 to take great photos of the most beautiful memories of your life. You can easily carry it with you anywhere you go in any environment; having confidence that your D7000 will resist most difficult surrounding circumstances of weather fluctuations and dust and so on!  Key Features of Nikon D7000: High Resolution 16.2 MP DX-format CMOS sensor for large prints and tight cropping. High Speed 6 frames per second continuous shooting up to 100 shots captures the most fleeting action. Twin SD Card Slots with SD, SDHC, and SDXC memory card compatibility gives you options to keep on shooting or separate your NEF (RAW), JPEG and movie files. Breathtaking Full 1080p HD Movies with Full Time Autofocus and external stereo microphone jack to record cinematic-quality movies up to 20 minutes. Dynamic ISO range from 100 to 6400 expandable to 25,600 (Hi2) lets you shoot in near darkness. Customizable 39 point AF System includes nine center cross-type sensors that operate with every AF NIKKOR lens so you can focus on making great images. Compact but durable with magnesium-alloy top and rear covers, superior weather and dust seals and a 150,000 cycle-rated shutter system providing reliable operation. 3 Inch, 921,000-dot Super-Density LCD Monitor with 170 degree viewing delivers bright, crisp image playback, and precise Live View and Movie shooting. Versatile Scene Modes lets you choose from Portrait, Landscape, Child, Sports, Close-up or Night Portrait for stunning results in otherwise challenging conditions. The Nikon D7000 has a variety of really wonderful features that inspire you and provide you with new ideas to shoot glamour and creative shots, and it gives you amazing and professional results that make you so proud! It is well suited to professional photographers, and even to beginners with creative photography talents. Itâ€™s one of the best DSLR cameras you could ever own!\n\n', '', NULL, 1),
(2523, 1014, 1, 'Sony Cyber-shot DSC-W730 (16.1 Megapixel, Compact Digital Camera, Silver)', 'Designed with a sleek and sophisticated finish, Cyber-shot W730 boasts a host of impressive yet user-friendly features that will delight any photo enthusiast. Its Optical SteadyShot (Active Mode) ensures smooth HD movies and its 16.1 megapixels image sensor results in awe-inspiring shots. Features Super HAD CCD sensor with 16.1 effective megapixels Carl Zeiss lens with 8x optical zoom HD Movie Shooting with SteadyShot (Active Mode) Intelligent Auto Mode Beauty Effect Picture Effects Mode for still images, panoramic shots and movies\n\n', '', NULL, 1),
(2524, 1015, 1, 'Sony Cyber-shot DSC-WX300 (18.2 Megapixel, Compact Digital Camera, White)', 'Get up close to whatever you are shooting with Cyber-shot WX300 - the worldâ€™s smallest, lightest* digital still camera! Shoot beautiful luminous pictures all day and even at night with its extended battery life. Features: The world''s smallest, lightest* camera with 20x optical zoom 18.2MP Exmor R CMOS sensor Full HD movies with Optical SteadyShot Built-in Wi-Fi for remote operations via smartphone or tablet Improved Superior Auto 10fps continuous shooting.\n', '', NULL, 1),
(2525, 1016, 1, 'Apple - MB829Z/A Apple Magic Mouse', 'Apple - MB829Z/A Apple Magic Mouse', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;USB Port&quot;:&quot;USB 2.0&quot;,&quot;Number of Keys&quot;:&quot;1&quot;,&quot;Input Registration&quot;:&quot;Optical Laser&quot;,&quot;Type of Connection&quot;:&quot;Bluetooth&quot;,&quot;Mouse Type&quot;:&quot;PC Mouse&quot;,&quot;Scrolling Type&quot;:&quot;2-ways&quot;}', NULL, 1),
(2526, 1016, 2, 'Apple - MB829Z/A Apple Magic Mouse', 'Apple - MB829Z/A Apple Magic Mouse', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;USB Port&quot;:&quot;USB 2.0&quot;,&quot;Number of Keys&quot;:&quot;1&quot;,&quot;Input Registration&quot;:&quot;Optical Laser&quot;,&quot;Type of Connection&quot;:&quot;Bluetooth&quot;,&quot;Mouse Type&quot;:&quot;PC Mouse&quot;,&quot;Scrolling Type&quot;:&quot;2-ways&quot;}', NULL, 1),
(2529, 1018, 1, 'Seagate Wireless Plus 1 TB Portable Hard Drive [STCK1000200]', 'Seagate Wireless Plus, mobile storage you can access without wires or Web With Seagate Wireless Plus, you can enjoy your media and access your files without wires or the Internet. This mobile storage device broadcasts its own Wi-Fi network, so you can wirelessly stream your media and files to your tablet or smartphone on-the-go and off-the-grid. The free Seagate Media app for iOS and Android makes it easy to navigate and enjoy content wherever you go. Forget about having to choose which files to load onto your tablet or smartphone before a trip. Bring it all with you! Wireless Plus has 1TB of built-in storage, which means you can load up to 500 movies or thousands of songs, photos and documents*. Simply drag-and-drop to load files wirelessly from your PC or Mac computer or use the USB 3.0 adapter to load files up to 10Ã— faster than Wi-Fi N. Wireless Plus allows up to eight tablets and smartphones to access and store content at the same time. Leave it in your bag, set it on the table, place it anywhere in the carâ€”with a range of up to 150ft youâ€™ll never feel tethered to your storage. Best of all, by creating its own Wi-Fi network, there is no need for an Internet connection and you don''t have to use your data plan.\n', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2530, 1018, 2, 'Seagate Wireless Plus 1 TB Portable Hard Drive [STCK1000200]', 'Seagate Wireless Plus, mobile storage you can access without wires or Web With Seagate Wireless Plus, you can enjoy your media and access your files without wires or the Internet. This mobile storage device broadcasts its own Wi-Fi network, so you can wirelessly stream your media and files to your tablet or smartphone on-the-go and off-the-grid. The free Seagate Media app for iOS and Android makes it easy to navigate and enjoy content wherever you go. Forget about having to choose which files to load onto your tablet or smartphone before a trip. Bring it all with you! Wireless Plus has 1TB of built-in storage, which means you can load up to 500 movies or thousands of songs, photos and documents*. Simply drag-and-drop to load files wirelessly from your PC or Mac computer or use the USB 3.0 adapter to load files up to 10Ã— faster than Wi-Fi N. Wireless Plus allows up to eight tablets and smartphones to access and store content at the same time. Leave it in your bag, set it on the table, place it anywhere in the carâ€”with a range of up to 150ft youâ€™ll never feel tethered to your storage. Best of all, by creating its own Wi-Fi network, there is no need for an Internet connection and you don''t have to use your data plan.\n', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1);
