(2531, 1019, 1, 'Seagate 500 GB Slim Portable Hard Drive USB 3.0 - Black [STCD500202]', 'Thin, Light and Easy Back-up The Seagate Slim portable drive is an extremely thin external hard drive, ideal for consumers who want to back-up their digital lives and take the drive with them on the go. At slightly thicker than a standard iPhone, the brushed metal design allows you to slide the drive into your pocket, purse or briefcase and carry it with you. Via the Seagate Dashboard, use the Protect function to set-up your easy, automatic local back-up with a one-click or scheduled plan. Keep multiple copies of your files in case disaster strikes.  With the Save feature, user-generated content can be backed-up from your favourite social networks. Many people use their smartphones to capture priceless moments, but while these devices are handy and readily available, storage is not their strong suit. Capture a memory, post it on a social networking site and let the Seagate Dashboard automatically back-up any content posted. Even if the file gets accidentally deleted from the device, another copy can be waiting.  The Share feature allows multiple files to be uploaded to social networks at once from your computer. The days of uploading individual files without creating a new album are gone. Simply select files to upload, choose where to post them and even add comments. Managing your social profile has never been easier. Install the preloaded NTFS driver on a Mac and use the drive interchangeably between PCs and Mac computers, without reformatting the drive. Slim is In The Seagate Slim portable drive is a thin and light way to back-up the things that are important to you on Windows computers. Protect your data with easy flexible back-ups Save photos automatically from your social networks Share photos and videos to social networks with a click.', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
