;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2533, 1020, 1, 'Seagate 1TB Backup Plus USB 3.0 Slim External Hard Drive - Black [STDR1000200]', 'Do more with social networksYou share tons of photos and videos with people on Facebook, Flickr, and YouTube-but do you have your own copies? Backup Plus is the place to preserve what you send out. You can even sync with your personal social media accounts and manage it all from the intuitive Seagate Dashboard.Works with PC or MacWhether you own a PC or a Mac computer, Backup Plus can be used interchangeably without reformatting.USB 3.0 plug-and-playYou can also easily upgrade to Thunderbolt technology or FireWire 800 with add-on adapters (sold separately). And USB 3.0 is backward compatible with USB 2.0.Share your favorite moments instantlyShare photos and videos to Facebook, Flickr, or YouTube-simultaneously-right from your Backup Plus drive. Smart integration with popular social media means your memories aren''t &quot;trapped&quot; in your drive, letting you publish them to the network of your choice. Protect your data with easy flexible backups Save photos automatically from your social networks Share photos and videos to social networks with a click Back up with your choice of a Thunderbolt or FireWire adapter.', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2534, 1020, 2, 'Seagate 1TB Backup Plus USB 3.0 Slim External Hard Drive - Black [STDR1000200]', 'Do more with social networksYou share tons of photos and videos with people on Facebook, Flickr, and YouTube-but do you have your own copies? Backup Plus is the place to preserve what you send out. You can even sync with your personal social media accounts and manage it all from the intuitive Seagate Dashboard.Works with PC or MacWhether you own a PC or a Mac computer, Backup Plus can be used interchangeably without reformatting.USB 3.0 plug-and-playYou can also easily upgrade to Thunderbolt technology or FireWire 800 with add-on adapters (sold separately). And USB 3.0 is backward compatible with USB 2.0.Share your favorite moments instantlyShare photos and videos to Facebook, Flickr, or YouTube-simultaneously-right from your Backup Plus drive. Smart integration with popular social media means your memories aren''t &quot;trapped&quot; in your drive, letting you publish them to the network of your choice. Protect your data with easy flexible backups Save photos automatically from your social networks Share photos and videos to social networks with a click Back up with your choice of a Thunderbolt or FireWire adapter.', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2535, 1021, 1, 'Seagate Expansion 1 TB External Hard Drive - STBX1000201', 'Seagate external portable drives are compact and perfect for on-the-go. Instantly add more storage space to your computer and take large files with you when you travel.Set-up is straightforward, simply connect a single USB cable and you are ready to go. The drive is powered from the USB cable, so there is no need for an external power supply. Plus, it is automatically recognized by Windows operating system, so there is no software to install and nothing to configure. Saving files is easy too,just drag-and-drop.Itâ€™s not just easy to use, but itâ€™s fast and energy efficient too. Enjoy fast data transfer speed with USB 3.0connectivity, backwards compatible with USB 2.0. Built-in power management ensures energy efficientoperation.\n', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2536, 1021, 2, 'Seagate Expansion 1 TB External Hard Drive - STBX1000201', 'Seagate external portable drives are compact and perfect for on-the-go. Instantly add more storage space to your computer and take large files with you when you travel.Set-up is straightforward, simply connect a single USB cable and you are ready to go. The drive is powered from the USB cable, so there is no need for an external power supply. Plus, it is automatically recognized by Windows operating system, so there is no software to install and nothing to configure. Saving files is easy too,just drag-and-drop.Itâ€™s not just easy to use, but itâ€™s fast and energy efficient too. Enjoy fast data transfer speed with USB 3.0connectivity, backwards compatible with USB 2.0. Built-in power management ensures energy efficientoperation.\n', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
