(2654, 1033, 1, 'Nokia Lumia 1020', 'he Nokia Lumia 1020, powered by Windows Phone 8, comes with MS Office and all the unique Lumia features like Nokia Music and free voice-guided navigation. Add on a wireless charging cover to power up without plugging in.\n\nYour moments captured like never before.\n\nThe Nokia Lumia 1020 takes photos and videos that no other smartphone can match with a 41 megapixel camera sensor, PureView technology, Optical Image Stabilisation and amazing high-resolution zoom.\nZoom. Reinvented.\n\nNokia Pro Cam on the Nokia Lumia 1020 lets you shoot in super high resolution, which means you can zoom in close to your shot after youâ€™ve taken it. Then rotate, reframe, crop and share new images as many times as you want.', '{&quot;Brand&quot;:&quot;Nokia&quot;,&quot;Color&quot;:&quot;Black&quot;,&quot;Memory Size&quot;:&quot;2GB RAM&quot;,&quot;Operating System&quot;:&quot;Android v4.3 (Jelly Bean) OS&quot;,&quot;Processor type&quot;:&quot;Quad-core 2.2 GHz&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Pixels&quot;,&quot;SIM Type&quot;:&quot;Nano SIM&quot;,&quot;Call Features&quot;:&quot;Loudspeaker,Call Timer, Call Divert&quot;,&quot;Browser&quot;:&quot;HTML5&quot;,&quot;Length&quot;:&quot;162.8 mm&quot;,&quot;Width&quot;:&quot;85.4 mm&quot;,&quot;Thickness&quot;:&quot;8.7 mm&quot;,&quot;Weight&quot;:&quot;209 g&quot;,&quot;Internal&quot;:&quot;32 GB&quot;,&quot;Expandable Memory&quot;:&quot;microSD,upto 64 GB&quot;,&quot;GPS&quot;:&quot;Yes&quot;,&quot;USB Connector&quot;:&quot;Yes&quot;,&quot;Display colors&quot;:&quot;TrueColor (24-bit\\/16M)&quot;,&quot;Pixel density&quot;:&quot;368 ppi&quot;,&quot;User Input&quot;:&quot;Touch&quot;,&quot;Bluetooth&quot;:&quot;Bluetooth 4.0&quot;,&quot;Battery&quot;:&quot;BV-4BW&quot;,&quot;Battery capacity&quot;:&quot;3400 mAh&quot;,&quot;Maximum standby time&quot;:&quot;32 days&quot;}', NULL, 1),
