(2656, 1034, 1, 'Nokia Lumia 1320 Smartphone', 'Bigger screen. More fun.\n\nSix-inch, 720p HD display, 4G LTE connectivity and bright, colourful design. Get more out of your videos, games and apps on the big screen. Turn your moments into great stories with Nokia Camera, Nokia Storyteller and exclusive photo editing tools like Cinemagraph and Creative Studio.\nWith a 6&quot; display and bright, colourful design that really stands out from the crowd, the Nokia Lumia 1320 makes a statement in any situation.\n\nFIT FOR BUSINESS.\n\nThe Nokia Lumia 1320 is a cost-effective business smartphone with built-in Microsoft Office and great applications like Microsoft Exchange, Office 365 and Lync. And enterprise-level security gives you peace of mind wherever you go.', '{&quot;Brand&quot;:&quot;Nokia&quot;,&quot;Color&quot;:&quot;Orange&quot;,&quot;Memory Size&quot;:&quot;1GB RAM&quot;,&quot;Operating System&quot;:&quot;Android v4.3 (Jelly Bean) OS&quot;,&quot;Processor type&quot;:&quot;Quad-core 2.2 GHz&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Pixels&quot;,&quot;SIM Type&quot;:&quot;Nano SIM&quot;,&quot;Call Features&quot;:&quot;Loudspeaker,Call Timer, Call Divert&quot;,&quot;Browser&quot;:&quot;HTML5&quot;,&quot;Length&quot;:&quot;162.8 mm&quot;,&quot;Width&quot;:&quot;71.4 mm&quot;,&quot;Thickness&quot;:&quot;10.4 mm&quot;,&quot;Weight&quot;:&quot;209 g&quot;,&quot;Internal&quot;:&quot;32 GB&quot;,&quot;Expandable Memory&quot;:&quot;microSD,upto 64 GB&quot;,&quot;GPS&quot;:&quot;Yes&quot;,&quot;USB Connector&quot;:&quot;Yes&quot;,&quot;Display colors&quot;:&quot;TrueColor (24-bit\\/16M)&quot;,&quot;Pixel density&quot;:&quot;368 ppi&quot;,&quot;User Input&quot;:&quot;Touch&quot;,&quot;Bluetooth&quot;:&quot;Bluetooth 4.0 &quot;,&quot;Battery&quot;:&quot;BV-4BW&quot;,&quot;Battery capacity&quot;:&quot;3400 mAh&quot;,&quot;Maximum standby time&quot;:&quot;32 days&quot;}', NULL, 1),
