(2662, 1038, 1, 'Canon EOS 700D Kit (EF S18-55 IS STM)', 'The Canon EOS 700D is a DSLR camera that comes with a huge list of advanced features. Starting with the 18MP Hybrid CMOS AF sensor, this camera can let you shoot high resolution images that can be enlarged and recomposed by cropping without losing detail. This black camera delivers Full HD 1080p video recording that accurately portrays the exact ambiance and emotions of a particular scene. It employs the Hybrid AF technology to ensure that your subject remains in focus continuously, irrespective of the lighting conditions or the movement of the subject. When you want to record videos in complete silence, you can use the Movie Servo AF mode. It works with compatible STM lenses, and ensures that the camera does not make any noise when focusing.\n\n18MP Hybrid CMOS AF Sensor,Full HD 1080p Recording,Fast AF Performance,3 Inch Vari Angle Clear View LCD II Touch Screen Monitor,Touch Screen Control,Scene Intelligent Auto,Creative Photography.', '{&quot;Brand&quot;:&quot;Canon&quot;,&quot;Display&quot;:&quot;3.0 TFT QVGA LCD Screen&quot;,&quot;Storage&quot;:&quot;External memory:Micro SD Card (up to 2GB guaranteed), Micro SDHC (up to 8GB guaranteed)&quot;,&quot;Effective Pixels&quot;:&quot;18 Mega pixels&quot;,&quot;Image Stabilization&quot;:&quot;DIS (Digital Image Stabilisation)&quot;,&quot;Flash&quot;:&quot;Auto,Auto &amp; Red-eye reduction, Fill-in flash,Slow sync,Flash off,Red-eye fix&quot;,&quot;Battery&quot;:&quot;BP70A (740mAh, Min.700mAh)&quot;,&quot;Dimensions&quot;:&quot;53.59 x 90.67 x 19.55mm&quot;,&quot;Resolution&quot;:&quot;230k&quot;}', NULL, 1),
