(2666, 1040, 1, 'Sony Cyber-Shot 16.1MP W Series Digital Camera Silver DSC-W730', 'Designed with a sleek and sophisticated finish, Cyber-shot W730 boasts a host of impressive yet user-friendly features that will delight any photo enthusiast. Its Optical SteadyShot (Active Mode) ensures smooth HD movies and its 16.1 megapixels image sensor results in awe-inspiring shots. Features Super HAD CCD sensor with 16.1 effective megapixels Carl Zeiss lens with 8x optical zoom HD Movie Shooting with SteadyShot (Active Mode) Intelligent Auto Mode Beauty Effect Picture Effects Mode for still images, panoramic shots and movies\n\n', '', NULL, 1),
