(2686, 1058, 1, 'Apple MacBook Air MD760', 'The New 13inch Apple MacBook Air MD760\nMacBook Air is unbelievably thin and light. But we also designed it to be powerful, capable, durable, and enjoyable to use. With enough battery life to get you through the day.\nUp to 12 hours of battery life.\n\nNow the 13-inch model gets up to 12 hours of battery life on a single charge and the 11-inch model gets up to 9 hours. \nFourth-generation Intel Core processors.\n\nMacBook Air is powered by the all-new fourth-generation Intel Core i5 and i7 processors. \nFaster all-flash storage.\n\nPart of what makes MacBook Air so responsive is that itâ€™s designed entirely around flash storage. \nMulti-Touch trackpad.\n\nThe Multi-Touch gestures in OS X make everything you do on MacBook Air more intuitive, direct, and fun. ', '', NULL, 1),
(2687, 1059, 1, 'Apple MacBook Air MD761', 'The New 13inch Apple MacBook Air MD761\nMacBook Air is unbelievably thin and light. But we also designed it to be powerful, capable, durable, and enjoyable to use. With enough battery life to get you through the day.\nUp to 12 hours of battery life.\n\nNow the 13-inch model gets up to 12 hours of battery life on a single charge and the 11-inch model gets up to 9 hours.\nFourth-generation Intel Core processors.\n\nMacBook Air is powered by the all-new fourth-generation Intel Core i5 and i7 processors.\nFaster all-flash storage.\n\nPart of what makes MacBook Air so responsive is that itâ€™s designed entirely around flash storage.\nMulti-Touch trackpad.\n\nThe Multi-Touch gestures in OS X make everything you do on MacBook Air more intuitive, direct, and fun.', '', NULL, 1),
(2688, 1060, 1, 'Apple MacBook Pro ME866 13â€‘inch 2.6GHz Intel Core i5 512GB Retina Display', 'Apple MacBook Pro ME866 13â€‘inch 2.6GHz Intel Core i5 512GB Retina Display\nApple''s MacBook Pro line has now gotten an entirely expected upgrade to current-generation Intel CPUs, just in time for the holiday shopping season. In our hands-on initial testing, these new 13-inch and 15-inch models look and feel just like the previous generation, but the promise of longer battery life, somewhat improved performance, faster Wi-Fi, and lower starting prices is enough to make this a significant overall update.\nStunning Retina display. Millions of pixels ahead of this time.\n\nThe 15â€‘inch model has over 5 million pixels, and the 13â€‘inch model has over 4 million. So you can retouch your photos or edit a home movie in HD and experience an astounding level of clarity. Text is razor sharp, too, so even everyday things like browsing the web and revising a document are better than ever. Itâ€™s a display worthy of the worldâ€™s most advanced notebook.\nNew high-performance technologies. Together they make quicker work of everything.\n\nWith fourth-generation dual-core and quad-core Intel processors, the latest graphics, PCIe-based flash storage, 802.11ac Wiâ€‘Fi, and Thunderbolt 2, MacBook Pro with Retina display delivers unprecedented performance â€” all around. \nThin. Light. Powerful. Thereâ€™s innovation in every nanometer.\n\nMacBook Pro packs a lot of power into not a lot of space.\nowerful apps included. Get right to work. And play.\n\nEvery new MacBook Pro comes with better-than-ever versions of iPhoto, iMovie, GarageBand, Pages, Numbers, and Keynote. \nOS X Mavericks. The worldâ€™s most advanced desktop operating system.\n\nOS X is what makes Mac a Mac. Itâ€™s designed to be intuitive and easy to use. It features an amazing collection of apps youâ€™ll use every day.', '', NULL, 1),
(2689, 1061, 1, 'Samsung Galaxy Grand Duos i9082', 'Samsung Galaxy Grand Duos\nBigger Screen, More Possibilities, Dual SIM Support!\n\nGALAXY GRAND offers maximum screen space on a slim, fully loaded smartphone for an endlessly entertaining mobile experience. Enjoy your videos, games and web time on a large, vivid display while holding it in one hand. Its bigger screen and slimmer body is ideal for playing games, watching videos or surfing the web.\n\n5&quot; Large Screen\n\nEverything from larger font size to immersive viewing, brilliant visuals are guaranteed. Enjoy exclusive viewing experience while on the go.\n\nPortable Design\n\nSlim design ensures portability of GALAXY Grand for those who want to have a large screen without compromising portability.\n\nJelly Bean OS,Dual SIM,8MP Camera\n\nMulti Window\nMulti Window helps easier multitasking.\n', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Color&quot;:&quot;White&quot;,&quot;Memory Size&quot;:&quot;8GB&quot;,&quot;Operating System&quot;:&quot;Android OS, v4.2.2 (Jelly Bean)&quot;,&quot;Resolution&quot;:&quot;480 x 800 (WVGA)&quot;,&quot;Processor&quot;:&quot;Dual Core Application Processor&quot;,&quot;Processor Speed&quot;:&quot;1.2GHz,Cortex A9 Dual&quot;,&quot;Standby time&quot;:&quot;Up to 490 Hours Standby Time (W-CDMA)&quot;,&quot;Phone camera&quot;:&quot;2 Megapixel&quot;,&quot;Networks&quot;:&quot;GSM 3G , HSPA-PLUS, EDGE \\/ GPRS, HSPA, 802.11 b\\/g\\/n, Wi-Fi Direct&quot;,&quot;Sensors&quot;:&quot;Accelerometer, Geo-magnetic, Gyro-sensor, Light Sensor, Proximity Sensor&quot;,&quot;Battery Capacity&quot;:&quot;2,100mAh&quot;,&quot;Dimension&quot;:&quot;143.7 x 77.1 x 9.6 mm&quot;}', NULL, 1),
