(2711, 1073, 1, 'Samsung 16.2 MP Digital Camera ST150', 'Share your best pictures in style with the ST150. Instantly email or upload high quality photos to your social networks, right from your camera.\n\nInstant Wireless Sharing\n\nInstantly send quality photos to social networks like Facebook or email them to a small group of peopleâ€”directly from the camera. The dedicated DIRECT LINK hot key helps you quickly connect to Wi-Fi networks. Access your uploaded content on supported connected devices.\n\nInstant Saving\n\nSimultaneously send every picture you take to your mobile phone via Wi-Fi connectionâ€”to make backing up and sharing your high-quality photos easy.\n\nCustomize and Edit\n\nEven if you''re not ready for your close-up, you can still create the perfect social network profile picture. Beauty Palette lets you choose from seven different makeup looks that help you change photos instantly.\n\nHybrid Touch Display\n\nThe Hybrid Touch Display offers two options: use the 5-way button to quickly move the cursor and intuitively navigate the menu and make selections. Alternately, when you want to enter text simply input the characters on the touch screen. It couldnâ€™t be easier.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Display&quot;:&quot;3.0 TFT QVGA LCD Screen&quot;,&quot;Storage&quot;:&quot;External memory: Micro SD Card (up to 2GB guaranteed), Micro SDHC (up to 8GB guaranteed)&quot;,&quot;Effective Pixels&quot;:&quot;16.2 Mega pixels&quot;,&quot;Lens&quot;:&quot;25mm Samsung&quot;,&quot;Image Stabilization&quot;:&quot;DIS (Digital Image Stabilisation)&quot;,&quot;Flash&quot;:&quot;Auto,Auto &amp; Red-eye reduction, Fill-in flash,Slow sync,Flash off,Red-eye fix&quot;,&quot;Battery&quot;:&quot;BP70A (740mAh, Min.700mAh)&quot;,&quot;Dimensions&quot;:&quot;53.59 x 90.67 x 19.55mm&quot;}', NULL, 1),
