(2715, 1075, 1, 'Nikon D5100 16MP Digital SLR Camera', 'Explore a new dimension of photography with the Nikon D5100, a high end DLSR camera that comes with loads of features. It features a 16.2MP CMOS sensor that captures even the tiniest details in any scene. Additionally, the EXPEED 2 image processor quickens up the process of images being captured and processed, enabling you to capture Full HD images at high speeds. The innovative Vari Angle LCD monitor swivels away from the camera body, allowing you to easily capture photos from awkward angles such as ground level, waist level, or over the head. The 921,000 dot LCD monitor also enables you to compose your shots accurately, and view all the recorded photos and videos with good detail. The D5100 provides you with a multitude of special effects to choose from. These effects can go a long way in making your photos look more fun and interesting. The 11 point AF system of this camera continuously tracks your subject if it is moving within the frame and ensures that it never loses focus, allowing for razor sharp photos.\n\nCreative Photography,Vari Angle LCD Monitor,Fun and Interesting Effects,Full HD 1080p D Movie with Audio Recording,Stunning Image Quality,High Speed Shooting,Sharp and Precise AF System,Automatic Flash,Compatibility with NIKKOR Lenses.\n\n', '{&quot;Brand&quot;:&quot;Nikon&quot;,&quot;Display&quot;:&quot;3.0 TFT QVGA LCD Screen&quot;,&quot;Storage&quot;:&quot;External memory: Micro SD Card (up to 2GB guaranteed), Micro SDHC (up to 8GB guaranteed)&quot;,&quot;Effective Pixels&quot;:&quot;18 Mega pixels&quot;,&quot;Image Stabilization&quot;:&quot;DIS (Digital Image Stabilisation)&quot;,&quot;Flash&quot;:&quot;Auto,Auto &amp; Red-eye reduction, Fill-in flash, Slow sync,Flash off,Red-eye fix&quot;,&quot;Battery&quot;:&quot;BP70A (740mAh, Min.700mAh)&quot;,&quot;Dimensions&quot;:&quot;53.59 x 90.67 x 19.55mm&quot;,&quot;Resolution&quot;:&quot;230k&quot;}', NULL, 1),
