(2727, 1082, 1, 'Apple Wireless Keyboard - English/Japanese [MC184]', 'Use the Apple Wireless Keyboard on your desk, on your lap, or anywhere within 30 feet of your Mac or iPad â€” all because of its built-in Bluetooth technology. Its compact design takes up 24 percent less space on your desktop than full-size keyboards, so you have extra room to move the keyboard around and mouse comfortably alongside of it. Youâ€™ll also feel a difference when you type on its low-profile anodized aluminum enclosure with crisp, responsive keys. Use the function keys for one-touch access to a variety of Mac features such as screen brightness, volume, eject, play/pause, Mission Control, and Launchpad. The Apple Wireless Keyboard requires just two AA batteries â€” one less than the previous model. And its intelligent power management system conserves battery life. So when youâ€™re not using the keyboard, it automatically powers down. The instant you start typing, it turns back on. Use the on/off switch when you''re away from your computer for a long time. \n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Model&quot;:&quot;MB110Z\\/A&quot;,&quot;Connectivity technology&quot;:&quot;Wired&quot;,&quot;Interface&quot;:&quot;USB&quot;,&quot;I\\/O ports&quot;:&quot;2x USB 2.0&quot;}', NULL, 1),
(2728, 1082, 2, 'Apple Wireless Keyboard - English/Japanese [MC184]', 'Use the Apple Wireless Keyboard on your desk, on your lap, or anywhere within 30 feet of your Mac or iPad â€” all because of its built-in Bluetooth technology. Its compact design takes up 24 percent less space on your desktop than full-size keyboards, so you have extra room to move the keyboard around and mouse comfortably alongside of it. Youâ€™ll also feel a difference when you type on its low-profile anodized aluminum enclosure with crisp, responsive keys. Use the function keys for one-touch access to a variety of Mac features such as screen brightness, volume, eject, play/pause, Mission Control, and Launchpad. The Apple Wireless Keyboard requires just two AA batteries â€” one less than the previous model. And its intelligent power management system conserves battery life. So when youâ€™re not using the keyboard, it automatically powers down. The instant you start typing, it turns back on. Use the on/off switch when you''re away from your computer for a long time. \n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Model&quot;:&quot;MB110Z\\/A&quot;,&quot;Connectivity technology&quot;:&quot;Wired&quot;,&quot;Interface&quot;:&quot;USB&quot;,&quot;I\\/O ports&quot;:&quot;2x USB 2.0&quot;}', NULL, 1),
(2729, 1083, 1, 'HP Scanjet G4050 Photo Scanner L1957A', 'Industry leading color accuracy using world''s first 6-color, 96-bit scanning. Capture colors that are 40% more accurate than other scanners, for true-to-the-original scans. High capacity adapter to scan up to 16 slides or 30 negatives at once.\n\nGet superior color accuracy and photo reproduction with 6-color, 96-bit scanningâ€”exclusive to HP\nEnjoy high-definition scans that make beautiful reprints with 4800 x 9600 dpi resolution.\nPreserve crisp text in documents with scans that deliver archival-quality results\nEdit text from scanned documents and magazinesâ€”such as letters and articlesâ€”using included software\nScan up to sixteen 35 mm slides or 30 negative framesâ€”and other film sizesâ€”using a built-in adapter\nRemove dust and scratches at the touch of a buttonâ€”without the need for software touch-ups\nBring old or damaged photos back to life by restoring faded color using included software\nRemove red-eye and enhance details in dark photos using HP Real Life technologies\nEnjoy quick, easy scanning of multiple photos, slides or negatives, and then save as separate files\nQuickly and easily scan, make reprints or copy documents and save images at the touch of a button', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 4800 dpi&quot;,&quot;Bit depth&quot;:&quot;96-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;11.93 x 20 x 4.25 in&quot;,&quot;Weight&quot;:&quot;5.3 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', NULL, 1),
