(2733, 1085, 1, 'HP Scanjet G3110 Photo Scanner L2698A', 'Enjoy easy scanning at the touch of a button with this stylish, affordable scanner. Get great results from your photos, slides and negatives, then enhance or restore them using intuitive software. Scan and manage documents for easy archiving too.\n\nFEATURES\n\nGet more from your photos with high-quality scanning and easy restoration.\nScan multiple photos, slides, negatives or even 3-D objects and save to separate files.\nTurn paperwork into editable documents and easy-to-archive digital files.', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 2400 dpi&quot;,&quot;Bit depth&quot;:&quot;48-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;373 x 274 x 44.5 mm&quot;,&quot;Weight&quot;:&quot;2.9 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', NULL, 1),
(2734, 1085, 2, 'HP Scanjet G3110 Photo Scanner L2698A', 'Enjoy easy scanning at the touch of a button with this stylish, affordable scanner. Get great results from your photos, slides and negatives, then enhance or restore them using intuitive software. Scan and manage documents for easy archiving too.\n\nFEATURES\n\nGet more from your photos with high-quality scanning and easy restoration.\nScan multiple photos, slides, negatives or even 3-D objects and save to separate files.\nTurn paperwork into editable documents and easy-to-archive digital files.', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 2400 dpi&quot;,&quot;Bit depth&quot;:&quot;48-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;373 x 274 x 44.5 mm&quot;,&quot;Weight&quot;:&quot;2.9 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', NULL, 1),
(2735, 1086, 1, 'HP Scanjet 3000s2 SheetFed Scanner L2737A', 'Scan business documents from your desktop, using a fast, reliable, sheet-feed scanner. Scan two-sided documents at up to 20 pages per minute, using the 50-page automatic document feeder, and catch misfed pages with ultrasonic double-feed detection.\n\nFEATURES\n\nDigitize documents with fast, two-sided scanning\nScan up to 20 ppm/40 ipm at 300 dpi in black and white, grayscale and color.\nScan up to 50 pages at a time while tending to other projectsâ€”just press Scan and walk away\nEasily convert your hard copies to digital files\nScan with the touch of a button\nIntegrates with leading content management applications using the TWAIN software driver\nCapture all the detail and fine print at up to 600 dpi scanning resolution\nScan in different file formatsâ€”PDF, TIFF, JPEG, Microsoft Wordâ€”and save disk space with smaller file sizes\nReliably scan every page of your document, using ultrasonic double-feed detection\nTackle a variety of paper types, thicknesses and sizes reliably\nRely on this scanner to work hard for you every day with a duty cycle of up to 1000 pages per day', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 2400 dpi&quot;,&quot;Bit depth&quot;:&quot;48-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;373 x 274 x 44.5 mm&quot;,&quot;Weight&quot;:&quot;2.9 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', NULL, 1),
