(2737, 1087, 1, 'Seagate Backup Plus 500GB Portable Drive', 'Keep copies of your precious digital files, in case disaster strikes\nImpressive 500GB storage capacity\nSave feature enables user-generated content to be backed up from your favorite social network\nShare feature allows multiple files to be uploaded to social networks at once from your computer', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2738, 1087, 2, 'HP Scanjet 3000s2 SheetFed Scanner L2737A', 'Keep copies of your precious digital files, in case disaster strikes\nImpressive 500GB storage capacity\nSave feature enables user-generated content to be backed up from your favorite social network\nShare feature allows multiple files to be uploaded to social networks at once from your computer', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2739, 1088, 1, 'Seagate Backup Plus 4TB Desktop Drive', 'Easy, flexible, built-in backup options Save photos automatically from your social networks Share photos and videos to social networks with a click Up to 4TB capacity for a lifetime of memories Increase transfer speeds by upgrading to Thunderbolt technology or FireWire 800', '[]', 'null', 1),
(2740, 1088, 2, 'Seagate Backup Plus 4TB Desktop Drive', 'Easy, flexible, built-in backup options\nSave photos automatically from your social networks\nShare photos and videos to social networks with a click\nUp to 4TB capacity for a lifetime of memories\nIncrease transfer speeds by upgrading to Thunderbolt technology or FireWire 800', '{&quot;Brand&quot;:&quot;Seagate&quot;,&quot;Storage Capacity&quot;:&quot;1 TB&quot;,&quot;Storage Device Type&quot;:&quot;External&quot;,&quot;Battery life&quot;:&quot;Up to 10-hour&quot;}', NULL, 1),
(2798, 1108, 1, 'LG NEXUS 5 D821 16GB, black', 'VIVID RESULTS WITH LESS SHAKE The Nexus 5 features an 8 megapixel camera with a resolution of 3264x2448 pixels that is very handy in taking pictures when you donâ€™t have a dedicated camera at your disposal. The camera features the Optical Image Stabilization technique that will reduce blurring associated with the motion of camera during exposure. In other words, it will steady the shots even with shaky hands so that your photos and videos come out steady and sharp.\nCAPTURE YOUR MOST MEMORABLE MOMENTS,ADD LIFE TO CAPTURED MEMORIES,PRINT ANYTIME, ANYWHERE.\n', '', NULL, 1),
(2799, 1109, 1, 'SAMSUNG GALAXY NOTE 3 N9005 32GB, black', 'Elegant and original; this premium smartphone lets you collect and share ideas from your daily life in a smart and simple way. Whether you''re looking for a device to help you think creatively or a powerful set of tools that can help organize your day, the Samsung Galaxy Note 3 N9005 LTE 32GB is the ultimate personal assistant.\n\nThe Samsung Note 3 comes with an updated S-Pen, more advanced than ever before, allowing a high degree of precision for onscreen selection and manipulation. Take outstanding pictures and videos with the 13MP camera.\n\nThe multi-touch Super AMOLED display measures a glorious 5.7 inches, providing the space needed to visualize information in ways not possible on most other phones.\n\nBesides all of that, the Note 3 packs a powerful 2.3 GHz Quad Core processor and the Adreno 330 graphics card, allowing advanced visuals to render flawlessly across the impressive display. And with 32GB of storage, you''ll have plenty of space to store all your videos, photos, and more.', '', NULL, 1),
(2800, 1110, 1, 'APPLE IPHONE 5S 32GB, gold', 'Newer, faster, better A 64-bit architecture chip, fingerprint identity technology, the finest optic engineering, and fully loaded OS come together to make the iPhone 5S. The phone is eons ahead of its time, and is quite the technological marvel. The colors of the iPhone 5S have been chosen based on how they stand in a worldly view- how much of the color is seen around us, how appealing is it to the human eye. Rest assured that all of these colors are known to have value and elicit a particular emotion. We made certain associations with the colors, and this has been scientifically proven. All the colors of the iPhone 5S will draw out certain sentiments in you.\nTouch ID. Your phone. Your identity. A user checks and uses his phone countless number of times. Entering a passcode each time can be quite a pain. There is also the matter of security. While a passcode can be stolen, a fingerprint cannot. With iPhone 5S, accessing your phone is easier, quicker, and much more personal; not to mention futuristic. With Touch ID, a new fingerprint identity sensor, you have to simply place your finger on the home screen to unlock the phone.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Gold&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1);
