(2801, 1110, 2, 'APPLE IPHONE 5S 32GB, gold', 'Newer, faster, better A 64-bit architecture chip, fingerprint identity technology, the finest optic engineering, and fully loaded OS come together to make the iPhone 5S. The phone is eons ahead of its time, and is quite the technological marvel. The colors of the iPhone 5S have been chosen based on how they stand in a worldly view- how much of the color is seen around us, how appealing is it to the human eye. Rest assured that all of these colors are known to have value and elicit a particular emotion. We made certain associations with the colors, and this has been scientifically proven. All the colors of the iPhone 5S will draw out certain sentiments in you.\nTouch ID. Your phone. Your identity. A user checks and uses his phone countless number of times. Entering a passcode each time can be quite a pain. There is also the matter of security. While a passcode can be stolen, a fingerprint cannot. With iPhone 5S, accessing your phone is easier, quicker, and much more personal; not to mention futuristic. With Touch ID, a new fingerprint identity sensor, you have to simply place your finger on the home screen to unlock the phone.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Gold&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1),
(2802, 1111, 1, 'APPLE IPHONE 5C 16GB, blue', 'Color is another reason to love iPhone. Now the color is another reason to love the iPhone. Every single feature added to the iPhone has been designed for one singular purpose- to make the experience better. The colors chosen for the iPhone 5C have gone through the same scrutiny and consideration usually applied for the core components of the phone. Even the Home screen and wallpaper colors of the phone have been designed to complement the exteriors. All of this comes together to make the iPhone an engaging and delightful device. Blue is the color of the sky and of the sea. It''s the canvas that so much of the world around us is set against. Yet very little in the natural world is set in blue. That''s why sapphires and jays stand out as much as they blend in. While stereotypically associated with boys'' blankets and Superman''s suits, the color itself knows no such limits. Apple chose a shade that''s intense but not overblown. Something for everyone. The science of great design and construction. The iPhone 5C is the iPhone as you have never seen it. Featuring an all-new design, the phone is beautifully, unapologetically plastic, effectively brining its five vibrant colors to life. Under the smooth surface of the seamless outer shell, lies a steel-reinforced frame that provides structural integrity. The perfect marriage of looks and durability, the iPhone 5C is reassuringly solid.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Blue&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1),
(2803, 1111, 2, 'APPLE IPHONE 5C 16GB, blue', 'Color is another reason to love iPhone. Now the color is another reason to love the iPhone. Every single feature added to the iPhone has been designed for one singular purpose- to make the experience better. The colors chosen for the iPhone 5C have gone through the same scrutiny and consideration usually applied for the core components of the phone. Even the Home screen and wallpaper colors of the phone have been designed to complement the exteriors. All of this comes together to make the iPhone an engaging and delightful device. Blue is the color of the sky and of the sea. It''s the canvas that so much of the world around us is set against. Yet very little in the natural world is set in blue. That''s why sapphires and jays stand out as much as they blend in. While stereotypically associated with boys'' blankets and Superman''s suits, the color itself knows no such limits. Apple chose a shade that''s intense but not overblown. Something for everyone. The science of great design and construction. The iPhone 5C is the iPhone as you have never seen it. Featuring an all-new design, the phone is beautifully, unapologetically plastic, effectively brining its five vibrant colors to life. Under the smooth surface of the seamless outer shell, lies a steel-reinforced frame that provides structural integrity. The perfect marriage of looks and durability, the iPhone 5C is reassuringly solid.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Blue&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1),
(2804, 1112, 1, 'SAMSUNG I9500 GALAXY S4 16GB, black', 'Life Companion! Make your life richer, simpler, and more fun. The new Samsung GALAXY S4 helps bring us closer and captures those fun moments when we are together. Each feature is designed to simplify our daily lives. It cares enough to monitor our health and well-being. In-short, the Samsung GALAXY S4 is there for you.\n\nCaptures all the Fun,Brings Everyone Together,Simplify your Task', '', NULL, 1),
(2852, 1099, 1, 'Samsung Galaxy S4 mini GT-I9190 (8 GB, 3G + Wifi, Black Mist)', 'The Galaxy range from Samsung has for quite some time been a rage in the Android market. With the high end Samsung Galaxy S4 mini, it further ups this reputation. Packed with a quad core processor and a whole lot of features, the phone has soon become the fastest selling smartphone in Samsung''s history. Compact and stylish. Big performance. Slip it into your pocket or use it one handed Enjoy smooth and powerful performance Use smart services for health, travel and more Play and share with friends using Group Play \n', '', NULL, 1),
