(2861, 1125, 1, 'Jennifer Lopez Live Perfume 100ml for Her', 'Joyous character of a fragrance can be sensed already by its package. This fragrance is full of life, happiness and rhythm. It translates the JLo''s parole ''living to be dancing'' into a fragrance. The top notes bring the harmony of Sicilian lemon, bergamot and pineapple. The heart, full of rhythm, unites the notes of red currant, peony and violet. The sweet and warm base reveals sandalwood, Tonka bean and caramel. Live was created by Dominique Ropion in 2005.\n', '{&quot;Brand&quot;:&quot;Jennifer Lopez&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Toilette&quot;}', NULL, 1),
