(2863, 1126, 1, 'Davidoff Cool Water Sensual Essence Perfume 100ml For Her', 'The fragrance is described as glamorous, alluring and sensual, inspired by golden sunset reflected on ocean surface. The fragrance evokes the flavors of salt and sea on warm skin and the atmosphere of a beach sunset.\n\n\n', '{&quot;Brand&quot;:&quot;Davidoff&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Parfum&quot;,&quot;Top Notes&quot;:&quot;Mandarin Orange&quot;}', NULL, 1),
