(2865, 1127, 1, 'Samsung Smart 46-Inch Full HD LED TV UA46F5500', 'Transform your living room into a movie theatre with the 32F4000 46 Inch HD LED Smart TV from Samsung. It features the latest technologies offered by Samsung that are sure to make every viewing experience a memorable one. You can enjoy movies, TV shows, and sports in the best possible way, as this TV renders the images at a maximum resolution of 1366 x 768 pixels. Thanks to Wide Color Enhancer Plus, every detail in the image is revealed. This allows you to watch your favorite movies in their truest colors. The HyperReal image engine further enhances your viewing experiences. There is a dedicated mode that lets you watch sports with ultimate realism. The Sports Mode automatically tunes the audio and video settings for providing the best sports viewing experience. Additionally, this TV also features a USB port. Using Samsung''s ConnectShare technology, you can plug in your flash drive or hard drive to enjoy hours of entertainment.\n', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;46 Inch&quot;,&quot;Warranty&quot;:&quot;1 year&quot;,&quot;Series&quot;:&quot;5 Series&quot;,&quot;Display&quot;:&quot;46 inch&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Resolution&quot;,&quot;Design&quot;:&quot;Logo Deco , Slim 1, NNB Bezel Type , Black Front Colour , Swivel (Left \\/ Right) , Quad Stand&quot;,&quot;Power&quot;:&quot;AC100 - 240V 50 \\/ 60Hz Power Supply&quot;,&quot;Dimension without stand&quot;:&quot;1,059.6 x 626.2 x 49.4mm&quot;,&quot;Dimension with stand&quot;:&quot;1,059.6 x 700.0 x 307.3mm&quot;,&quot;Weight without stand&quot;:&quot;10.8Kg&quot;}', NULL, 1),
