(2875, 1133, 1, 'Sony Xperia Go', 'Ups, downs and sudden showers. Weâ€™ve designed Xperia go to handle everything life dishes out. We gave it a scratch-resistant display, a battery-save mode for when youâ€™re running late and made sure it had the highest water and dust resistance of any smartphone. As a final trick, we put all this toughness in an elegant costume. At just 9.8 mm, youâ€™d never guess that slim Xperia go is a giant on durability. Finally, a smartphone thatâ€™s as stylish as it is strong.', '', NULL, 1),
(2962, 1102, 1, 'LG D821 Nexus 5 (16 GB, Android 4.4 KitKat, 4G LTE + Wifi, Black)', 'VIVID RESULTS WITH LESS SHAKE The Nexus 5 features an 8 megapixel camera with a resolution of 3264x2448 pixels that is very handy in taking pictures when you donâ€™t have a dedicated camera at your disposal. The camera features the Optical Image Stabilization technique that will reduce blurring associated with the motion of camera during exposure. In other words, it will steady the shots even with shaky hands so that your photos and videos come out steady and sharp.\nCAPTURE YOUR MOST MEMORABLE MOMENTS,ADD LIFE TO CAPTURED MEMORIES,PRINT ANYTIME, ANYWHERE.\n', '', NULL, 1),
(2963, 1103, 1, 'Samsung Galaxy Note 3 N9005 (32 GB, 4G LTE + Wifi, Rose Gold Black)', 'Elegant and original; this premium smartphone lets you collect and share ideas from your daily life in a smart and simple way. Whether you''re looking for a device to help you think creatively or a powerful set of tools that can help organize your day, the Samsung Galaxy Note 3 N9005 LTE 32GB is the ultimate personal assistant.\n\nThe Samsung Note 3 comes with an updated S-Pen, more advanced than ever before, allowing a high degree of precision for onscreen selection and manipulation. Take outstanding pictures and videos with the 13MP camera.\n\nThe multi-touch Super AMOLED display measures a glorious 5.7 inches, providing the space needed to visualize information in ways not possible on most other phones.\n\nBesides all of that, the Note 3 packs a powerful 2.3 GHz Quad Core processor and the Adreno 330 graphics card, allowing advanced visuals to render flawlessly across the impressive display. And with 32GB of storage, you''ll have plenty of space to store all your videos, photos, and more.', '', NULL, 1),
(2964, 1104, 1, 'Apple iPhone 5S (32 GB, 4G LTE + Wi-Fi, Gold)', 'Newer, faster, better A 64-bit architecture chip, fingerprint identity technology, the finest optic engineering, and fully loaded OS come together to make the iPhone 5S. The phone is eons ahead of its time, and is quite the technological marvel. The colors of the iPhone 5S have been chosen based on how they stand in a worldly view- how much of the color is seen around us, how appealing is it to the human eye. Rest assured that all of these colors are known to have value and elicit a particular emotion. We made certain associations with the colors, and this has been scientifically proven. All the colors of the iPhone 5S will draw out certain sentiments in you.\nTouch ID. Your phone. Your identity. A user checks and uses his phone countless number of times. Entering a passcode each time can be quite a pain. There is also the matter of security. While a passcode can be stolen, a fingerprint cannot. With iPhone 5S, accessing your phone is easier, quicker, and much more personal; not to mention futuristic. With Touch ID, a new fingerprint identity sensor, you have to simply place your finger on the home screen to unlock the phone.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Gold&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1),
