(2966, 1105, 1, 'Apple iPhone 5C (16 GB, 4G LTE + Wi-Fi, Blue)', 'Color is another reason to love iPhone. Now the color is another reason to love the iPhone. Every single feature added to the iPhone has been designed for one singular purpose- to make the experience better. The colors chosen for the iPhone 5C have gone through the same scrutiny and consideration usually applied for the core components of the phone. Even the Home screen and wallpaper colors of the phone have been designed to complement the exteriors. All of this comes together to make the iPhone an engaging and delightful device. Blue is the color of the sky and of the sea. It''s the canvas that so much of the world around us is set against. Yet very little in the natural world is set in blue. That''s why sapphires and jays stand out as much as they blend in. While stereotypically associated with boys'' blankets and Superman''s suits, the color itself knows no such limits. Apple chose a shade that''s intense but not overblown. Something for everyone. The science of great design and construction. The iPhone 5C is the iPhone as you have never seen it. Featuring an all-new design, the phone is beautifully, unapologetically plastic, effectively brining its five vibrant colors to life. Under the smooth surface of the seamless outer shell, lies a steel-reinforced frame that provides structural integrity. The perfect marriage of looks and durability, the iPhone 5C is reassuringly solid.\n', '{&quot;Brand&quot;:&quot;Apple&quot;,&quot;Color&quot;:&quot;Blue&quot;,&quot;Operating System&quot;:&quot;IOS 7&quot;,&quot;Resolution&quot;:&quot;640 x 1136 pixels&quot;,&quot;Storage Capacity&quot;:&quot;32 GB&quot;,&quot;Width&quot;:&quot;58.6 mm&quot;,&quot;CPU Speed&quot;:&quot;1.7 Ghz&quot;,&quot;Wireless Connections&quot;:&quot;Yes, 802.11a\\/b\\/g\\/n Wi-Fi&quot;,&quot;Standby time&quot;:&quot;Up to 250 hours&quot;,&quot;Phone camera&quot;:&quot;8 Megapixel&quot;,&quot;Operating frequency&quot;:&quot;850, 900 ,1800,1900&quot;,&quot;User Interface&quot;:&quot;Touchscreen&quot;,&quot;Product weight&quot;:&quot;132 grams&quot;,&quot;CPU&quot;:&quot;Dual core 1.7 GHz&quot;}', NULL, 1),
