(2968, 1106, 1, 'Samsung Galaxy S4 mini GT-I9190 (8 GB, 3G + Wifi, Black Mist)', 'The Galaxy range from Samsung has for quite some time been a rage in the Android market. With the high end Samsung Galaxy S4 mini, it further ups this reputation. Packed with a quad core processor and a whole lot of features, the phone has soon become the fastest selling smartphone in Samsung''s history. Compact and stylish. Big performance. Slip it into your pocket or use it one handed Enjoy smooth and powerful performance Use smart services for health, travel and more Play and share with friends using Group Play \n', '', NULL, 1),
