(2970, 1113, 1, 'Britney Spears Fantasy the Naughty Remix for Women (100ml, Eau de Parfum)', 'The Naughty Remix, described as sensual, dark and exotic version, highlights jasmine petals, white chocolate orchid, sweet cupcake accord, sensual woody notes, orris root and creamy musk.', '{&quot;Brand&quot;:&quot;Britney Spears&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Parfum&quot;}', NULL, 1),
