(2972, 1114, 1, 'Britney Spears Fantasy the Nice Remix For Women (100ml, Eau De Parfum)', 'The Nice Remix, as romantic and flirty version, is a sparkling fruity scent that blends signature kiwi accord with floral tones such as jasmine, sweet cupcake and creamy musk.', '{&quot;Brand&quot;:&quot;Britney Spears&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Parfum&quot;}', NULL, 1),
