(2974, 1115, 1, 'Davidoff Cool Water Sea Rose Coral Reef Limited Edition For Women (100ml, Eau de Toilette)', 'In March 2014 Davidoff is launching three new fragrances that belong to the collection Coral Reef, inspired by beautiful coral reefs. Since the first edition Cool Water which was launched in 1988, Davidoff turned to oceans and every year the house introduced new, limited editions that provide a refreshing and characteristic blend of aromatic-marine notes. Since 2012 the house of Davidoff has been in partnership with National Geographic Society for the purpose of ocean protection, and the program of protection was named &quot;Pristine Seas&quot;. The new limited Davidoff trio is dedicated to preserving Indo-Pacific coral reef, often called ''the rain reef of the sea''. Women''s limited edition Sea Rose Coral Reef Edition was created as a hidden sea jewel which glitters in top notes with luminous accords of mandarin contrasting to seductive rose in the heart. The base of the composition contains sensational woody shades of cashmeran taking us to enchanting and unrevealed depths.\n', '{&quot;Brand&quot;:&quot;Davidoff&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Toilette&quot;,&quot;Top Notes&quot;:&quot;Mandarin Orange&quot;}', NULL, 1);
