(3004, 1180, 1, 'Davidoff Cool Water Sensual Essence for Women (100ml, Eau de Perfume)', 'In March 2014 Davidoff is launching three new fragrances that belong to the collection Coral Reef, inspired by beautiful coral reefs. Since the first edition Cool Water which was launched in 1988, Davidoff turned to oceans and every year the house introduced new, limited editions that provide a refreshing and characteristic blend of aromatic-marine notes. Since 2012 the house of Davidoff has been in partnership with National Geographic Davidoff presents a new edition of the women''s fragrance Cool Water (1996), the warm and shimmering Cool Water Sensual Essence. The fragrance is described as glamorous, alluring and sensual, inspired by golden sunset reflected on ocean surface. The fragrance evokes the flavors of salt and sea on warm skin and the atmosphere of a beach sunset. Perfumer Nathalie Lorson tried to achieve this with notes of exotic flowers and vanilla. The top accords of the composition are bergamot and red fruits that lead to the floral heart of orchid and frangipani. The base rounds the fragrance with aromas of vanilla, musk and woods. The signature-shaped curvy bottle and box emphasize glamour and sun-inspired theme of this perfume with golden shades. The campaign model is Bianca Balti in the role of a modern mermaid. Cool Water Sensual Essence was launched in 2012.\n\n\n', '{&quot;Brand&quot;:&quot;Davidoff&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Parfum&quot;,&quot;Top Notes&quot;:&quot;Mandarin Orange&quot;}', NULL, 1),
