(3006, 1181, 1, 'Jennifer Lopez Jlo Live For Women 100ML', 'Joyous character of a fragrance can be sensed already by its package. This fragrance is full of life, happiness and rhythm. It translates the JLo''s parole ''living to be dancing'' into a fragrance. The top notes bring the harmony of Sicilian lemon, bergamot and pineapple. The heart, full of rhythm, unites the notes of red currant, peony and violet. The sweet and warm base reveals sandalwood, Tonka bean and caramel.\n', '{&quot;Brand&quot;:&quot;Jennifer Lopez&quot;,&quot;Size&quot;:&quot;100 ML&quot;,&quot;Fragrance Family&quot;:&quot;Floral&quot;,&quot;Fragrance Type&quot;:&quot;Eau de Toilette&quot;}', NULL, 1),
