(3010, 1183, 1, 'Samsung 32 Inch LED TV 32F4000', 'The 32F4000 32 Inch LED TV from Samsung brings the next level of entertainment to your doorstep. Packed with ultra modern technologies, this brilliant TV enhances your viewing experience. It uses Samsungâ€™s Clean View technology to clean the digital and analog noise from the video signal. The Analog Noise Filter provides you with the best possible image clarity by eliminating the visual noise from the cable and air sources. This TV also features a Sports Mode that is guaranteed to take your sports viewing experience to the next level. It provides the best possible sound and picture clarity to make you feel like you are watching the game from the stadium. Furthermore, the Wide Color Enhancer Plus module pioneered by Samsung reveals the smallest details in the images to enhance the overall clarity. Moreover, with USB connectivity, this TV provides you with the convenience of watching movies or listening to your favorite tracks whenever you want.\n\n', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;32 Inch&quot;,&quot;Warranty&quot;:&quot;1 year&quot;,&quot;Series&quot;:&quot;5 Series&quot;,&quot;Display&quot;:&quot;32 inch&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Resolution&quot;,&quot;Design&quot;:&quot;Logo Deco , Slim 1, NNB Bezel Type , Black Front Colour , Swivel (Left \\/ Right) , Quad Stand&quot;,&quot;Power&quot;:&quot;AC100 - 240V 50 \\/ 60Hz Power Supply&quot;,&quot;Dimension without stand&quot;:&quot;1,059.6 x 626.2 x 49.4mm&quot;,&quot;Dimension with stand&quot;:&quot;1,059.6 x 700.0 x 307.3mm&quot;,&quot;Weight without stand&quot;:&quot;10.8Kg&quot;,&quot;Item EAN&quot;:&quot;2724274181392&quot;}', NULL, 1),
