(3099, 1173, 1, 'Sony Xperia M Dual SIM C2005 (4 GB, WiFi + 3G, White)', 'Stylish and elegant, the Sony Xperia M Dual SIM C2005 is just what you need for a perfect smartphone experience. The phone supports 3G networks and features built in WiFi that helps you to easily access various websites and web based applications on the move. It sports an incredible 4 Inch TFT display screen that offers great visual performances with its resolution of 854 x 480pixels. The phone is powered by a 1 GHz Qualcomm Dual core processor that ensures smooth functioning of its various applications. Users can capture amazing pictures with the built in 5MP camera and store them within the 4GB internal storage space of the phone. The phone sports a sleek design and is available in milky white color.', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;White&quot;,&quot;Networking&quot;:&quot;LTE 1, 3, 5, 7, 8, 20&quot;,&quot;Resolution&quot;:&quot;480 x 800 &quot;,&quot;Storage Capacity&quot;:&quot;8 GB&quot;,&quot;Width&quot;:&quot;69.17 mm&quot;,&quot;CPU Speed&quot;:&quot;2.3 GHz&quot;,&quot;Phone camera&quot;:&quot;13 Megapixel&quot;,&quot;User Interface&quot;:&quot;Touch&quot;,&quot;Video Formats&quot;:&quot;MP4, H.264, H.263&quot;,&quot;Hard Disk Capacity&quot;:&quot;16 GB&quot;,&quot;SIM Type&quot;:&quot;Micro SIM&quot;,&quot;Operating System&quot;:&quot;Android&quot;}', NULL, 1),
