(3103, 1175, 1, 'Nokia Lumia 520 (8 GB, Windows Phone, 3G + WiFi, Red)', 'The Nokia Lumia 520 is a dazzling smartphone that comes packed with optimal messaging, multimedia, connectivity and security features. It sports a stylish monoblock design and is available in bright red color. Fitted with a 4inch IPS LCD display, the phone is capable of displaying up to 16M colors. The phone features a 5MP VGA camera that helps to capture high quality pictures and videos. The smartphone is loaded with a host of apps to cater to entertainment, utility and business purposes. Users can access Internet on the go via WCDMA / GSM networks, or through built in WLAN capability. An internal storage space of 8GB is offered by the phone to store user data. Users can even store additional data on the 7GB cloud storage offered by the device. The phone lasts for a long time in between charges 3.7V, 1430mAh battery.\n\n', '{&quot;Brand&quot;:&quot;Nokia&quot;,&quot;Color&quot;:&quot;Red&quot;,&quot;Networking&quot;:&quot;LTE 1, 3, 5, 7, 8, 20&quot;,&quot;Resolution&quot;:&quot;480 x 800 &quot;,&quot;Storage Capacity&quot;:&quot;8 GB&quot;,&quot;Width&quot;:&quot;69.17 mm&quot;,&quot;CPU Speed&quot;:&quot;2.3 GHz&quot;,&quot;Phone camera&quot;:&quot;13 Megapixel&quot;,&quot;User Interface&quot;:&quot;Touch&quot;,&quot;Video Formats&quot;:&quot;MP4, H.264, H.263&quot;,&quot;Hard Disk Capacity&quot;:&quot;16 GB&quot;,&quot;SIM Type&quot;:&quot;Micro SIM&quot;,&quot;Operating System&quot;:&quot;Android&quot;}', NULL, 1),
