(3129, 1223, 1, 'Samsung 27â€ Series 7 LED Monitor LS27C750PS', 'The new Samsung LED Monitor Series 7 its improved design provides an excellent view and convenience. The ultra-slim narrow bezel gives it a sleek and stylish look, while its pivot feature allows you to rotate the screen to get desired information. A Wide Viewing Angle gives you the best view at any angle. Get the best picture quality and perfect colour with Mega DCR and a Static CR of 5,000:1, which provides a richer, more immersive picture experience like never before.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;27 Wide Viewing Angle LED&quot;,&quot;Brightness&quot;:&quot;300cd\\/m&quot;,&quot;Contrast Ratio&quot;:&quot;Mega \\u221e DCR (Static 3000:1&quot;,&quot;Resolution&quot;:&quot;1920 x 1080&quot;,&quot;Viewing Angle&quot;:&quot;(Horizontal\\/Vertical)l 178\\u00b0 \\/ 178\\u00b0)&quot;,&quot;Color Support&quot;:&quot;16.7M&quot;,&quot;Dimensions with stand&quot;:&quot;624.6 x 515.6 x 200.0mm&quot;,&quot;Weight&quot;:&quot;5.8Kg&quot;,&quot;Power Consumption&quot;:&quot;23W&quot;}', NULL, 1),
(3130, 1223, 2, 'Samsung 27â€ Series 7 LED Monitor LS27C750PS', 'The new Samsung LED Monitor Series 7 its improved design provides an excellent view and convenience. The ultra-slim narrow bezel gives it a sleek and stylish look, while its pivot feature allows you to rotate the screen to get desired information. A Wide Viewing Angle gives you the best view at any angle. Get the best picture quality and perfect colour with Mega DCR and a Static CR of 5,000:1, which provides a richer, more immersive picture experience like never before.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;27 Wide Viewing Angle LED&quot;,&quot;Brightness&quot;:&quot;300cd\\/m&quot;,&quot;Contrast Ratio&quot;:&quot;Mega \\u221e DCR (Static 3000:1&quot;,&quot;Resolution&quot;:&quot;1920 x 1080&quot;,&quot;Viewing Angle&quot;:&quot;(Horizontal\\/Vertical)l 178\\u00b0 \\/ 178\\u00b0)&quot;,&quot;Color Support&quot;:&quot;16.7M&quot;,&quot;Dimensions with stand&quot;:&quot;624.6 x 515.6 x 200.0mm&quot;,&quot;Weight&quot;:&quot;5.8Kg&quot;,&quot;Power Consumption&quot;:&quot;23W&quot;}', NULL, 1),
(3263, 1230, 1, 'Nikon CoolPix S3500 (20.1 Megapixel, Compact Digital Camera, Pink)', 'Owing to its light weight and compact dimensions, the CoolPix S3500 digital point and shoot camera from Nikon is an ideal travel companion. It fits easily in your travel bag and does not come in the way. This Nikon camera can record high quality photos even in dim lighting conditions with the 20.1MP 1/2.3inch CCD sensor. The 26 to 182mm (35mm equivalent) NIKKOR ED glass lens makes the S3500 great for shooting wide angle, as well as portrait photos. The 7x optical and 4x digital zoom of the camera lets you shoot clear photos of faraway subjects. The snazzy pink color of this camera lends it a touch of style and smartness.', '{&quot;Brand&quot;:&quot;Nikon&quot;,&quot;Color&quot;:&quot;Pink&quot;,&quot;Digital Camera Type&quot;:&quot;Compact Digital Camera&quot;,&quot;Megapixel&quot;:&quot;20.1 MP&quot;,&quot;Optical Zoom&quot;:&quot;7X&quot;,&quot;Screen Size&quot;:&quot;2.7 inch&quot;,&quot;Flash&quot;:&quot;Built In Flash&quot;,&quot;Battery life&quot;:&quot;220&quot;,&quot;Zoom capability&quot;:&quot;4x&quot;}', NULL, 1),
