(3265, 1231, 1, 'Sony Cyber-Shot DSC-TX20 (16.2 Megapixel, Point &amp; Shoot Camera, Black)', 'Capture the precious moments of your life in vivid colors and amazing detail with the Sony Cyber Shot DSC TX20 digital point and shoot camera. It features a 16.2MP Back Illuminated Exmor R CMOS sensor, which works along with the BIONZ image processor to deliver high definition images with low distortion at high speeds. The 25 to 100mm Carl Zeiss Vario Tessar lens harnesses the capability of the sensor to deliver crisp and sharp pictures with high detail. With a recording rate of 10 fps, this black camera lets you capture those elusive moments of life that are often missed by other cameras.', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;Black&quot;,&quot;Digital Camera Type&quot;:&quot;Point &amp; shoot camera&quot;,&quot;Megapixel&quot;:&quot;16.2 MP&quot;,&quot;Optical Zoom&quot;:&quot;4X&quot;,&quot;Screen Size&quot;:&quot;3.0 inch&quot;,&quot;Flash&quot;:&quot;Built In Flash&quot;,&quot;Battery life&quot;:&quot;220&quot;,&quot;Zoom capability&quot;:&quot;4x&quot;,&quot;Memory Size&quot;:&quot;19&quot;}', NULL, 1),
