(3267, 1232, 1, 'Sony Cyber-SHOT DSC-W730 P (16.1 Megapixel, Point &amp; Shoot Camera, Pink)', 'The CyberShot DSC W730 P from Sony is fully equipped to capture photos that will dazzle you with their brilliance. The snazzy pink color of this camera lends it a vibrant look. Featuring a 16.1MP 1/2.3inch type image sensor, this digital point and shoot camera captures the scene as it is, in its true colors. Helping the sensor achieve this feat is the high quality 28 to 224mm Carl Zeiss Vario Tessar lens. It lets you take amazing portrait shots, as well as scintillating landscape images with ease. An aperture range of 3.3 to 6.3 assists the camera in delivering consistent performance even in inconsistent lighting .', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;Pink&quot;,&quot;Digital Camera Type&quot;:&quot;Point &amp; shoot camera&quot;,&quot;Megapixel&quot;:&quot;16.1 MP&quot;,&quot;Optical Zoom&quot;:&quot;8X&quot;,&quot;Screen Size&quot;:&quot;2.7 inch&quot;,&quot;Flash&quot;:&quot;Built In Flash&quot;,&quot;Battery life&quot;:&quot;220&quot;,&quot;Zoom capability&quot;:&quot;4x&quot;,&quot;Memory Size&quot;:&quot;19&quot;}', NULL, 1),
