(3269, 1233, 1, 'Sony Cyber Shot DSC-HX300/B (50x Optical Zoom, 20.4 Megapixels, Point &amp; Shoot Camera, Black)', 'The Sony Cyber Shot DSC-HX300 is a powerful 20.4MP compact camera with 50x optical zoom that makes shooting close up photos as easy as a pie. The 50 x optical and the 100 x clear image digital zoom technology can capture far away subjects without any difficulties. Optical SteadyShot image stabilization eliminates blurry images or shaky videos. Users can even record blur free videos with this camera. The 20.4MP Exmor R CMOS sensor helps in capturing high resolution images, even in low light conditions, that are not pixilated or patchy, and are completely grain free. The Sony Cyber Shot DSC-HX300 can record Full 1080 / 1060p as well. It can even shoot still, and video footage at the same time. The tilting 3inch LCD viewfinder lets you review your footage from virtually any angle. You can even shoot a sequence of photos of a moving subject, making the camera perfect for sports, or action photography.', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;Black&quot;,&quot;Digital Camera Type&quot;:&quot;Point &amp; shoot camera&quot;,&quot;Megapixel&quot;:&quot;20.4 MP&quot;,&quot;Optical Zoom&quot;:&quot;50X&quot;,&quot;Screen Size&quot;:&quot;3.0 inch&quot;,&quot;Flash&quot;:&quot;Built In Flash&quot;,&quot;Battery life&quot;:&quot;220&quot;,&quot;Zoom capability&quot;:&quot;810&quot;}', NULL, 1);
