(3271, 1234, 1, 'Sony Cyber-SHOT DSC-WX300/W (18.2 Megapixels, Compact Digital Camera, White)', 'The sleek and compact body of this white CyberShot DSCWX300 digital point and shoot camera does not give away any hint of the potential it packs. You will be amazed at how far the zoom lens extends from within the body. The 27 to 540mm wide angle to telephoto lens enables you to masterfully capture portrait as well as landscape shots. And when something very interesting catches your eye on the landscape, you can instantly get a better look at it using the massive 20x zoom. The 18.2MP Exmor R CMOS sensor brings it all together to create a wonderfully detailed and vividly colored image that perfectly captures the emotions of the scene.', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;White&quot;,&quot;Digital Camera Type&quot;:&quot;Compact Camera&quot;,&quot;Megapixel&quot;:&quot;18.2 MP&quot;,&quot;Optical Zoom&quot;:&quot;20X&quot;,&quot;Screen Size&quot;:&quot;3.0 inch&quot;,&quot;Flash&quot;:&quot;Built In Flash&quot;,&quot;Battery life&quot;:&quot;220&quot;,&quot;Zoom capability&quot;:&quot;306&quot;}', NULL, 1),
