(3281, 1239, 1, 'Samsung Galaxy S4 Mini Dual Sim i9192 (8GB, 3G + WIFI, Black)', 'The Galaxy range from Samsung has for quite some time been a rage in the Android market. With the high-end Samsung Galaxy S4 mini, it further ups this reputation. Packed with a quad-core processor and a whole lot of features, the phone has soon become the fastest selling smartphone in Samsung''s history. Compact and stylish. Big performance. Slip it into your pocket or use it one-handed Enjoy smooth and powerful performance Use smart services for health, travel and more Play and share with friends using Group Play.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Color&quot;:&quot;Black&quot;,&quot;Operating System&quot;:&quot;Android OS, v4.2.2 (Jelly Bean)&quot;,&quot;Type&quot;:&quot;Smart Phones&quot;,&quot;RAM&quot;:&quot;8 GB&quot;,&quot;Resolution&quot;:&quot;540 x 960&quot;}', NULL, 1),
