(3283, 1240, 1, 'Nokia Lumia 520 (8 GB, Windows Phone, 3G + WiFi, White)', 'The Nokia Lumia 520 is a sophisticated phone featuring a compact, slim, and sleek design. With optimum connectivity and utility features, the Nokia Lumia 520 is a perfect phone, be it for business or entertainment. The phone is equipped with a 4inch WVGA super sensitive touchscreen that offers a resolution of 800 x 480. The main feature of this device is its powerful 5MP camera that is enhanced with 4x zoom facility. The phone incorporates numerous apps for personal, business or entertainment purposes, making this an all round device. These apps are powered by a 1GHz, dual core Qualcomm Snapdragon S4 processor, and 512MB RAM. Multiple security features ensure your phone is never misused. The device comes with various connectivity options to seamlessly connect to the Internet. It also supports USB, Bluetooth and hands free capabilities. The phone offers an internal storage space of 8GB to its users along with 7GB cloud storage space. Its pristine white design lends the device a high end look.', '{&quot;Brand&quot;:&quot;Nokia&quot;,&quot;Color&quot;:&quot;White&quot;,&quot;Operating System&quot;:&quot;Windows 8&quot;,&quot;Type&quot;:&quot;Smart Phones&quot;,&quot;RAM&quot;:&quot;8 GB&quot;,&quot;Resolution&quot;:&quot;480 x 800 pixels&quot;,&quot;CPU Speed&quot;:&quot;1 Ghz&quot;,&quot;CPU&quot;:&quot;Dual Core&quot;,&quot;Megapixel&quot;:&quot;5 Megapixel&quot;,&quot;Screen Size&quot;:&quot;4.0 Inch&quot;,&quot;Bluetooth version&quot;:&quot;v4.0&quot;}', NULL, 1),
