(3291, 1244, 1, 'Samsung Galaxy Grand 2 Dual SIM SM-G7102 (8 GB, Android OS, 3G + Wifi, Black)', 'The new Samsung Galaxy Grand 2 is an outstanding smartphone from one of the world''s biggest smartphone manufacturers, Samsung. The phone features an excellent 5.2 inch high definition display that produced crystal clear imagery. The phone has the features that make it perfect for work as well as recreation. It is powered by a quad core processor and has a processing speed of 1.2GHz. The phone has 1.5GB of RAM and 8GB of onboard storage space. It runs on the Android operating system. The phone is loaded with many incredible features like Sound and Shot, Group Play, and S translator that give you a superb multimedia experience. Tools such as Bluetooth 4.0 and GPS with Glonass technology provide you with unhindered wireless connectivity. Samsung galaxy grand 2 features an 8MP rear camera as well as a 1.9MP front camera. The dual SIM feature of this phone eliminates the need of an extra phone for business or personal purposes.', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Color&quot;:&quot;Black&quot;,&quot;Operating System&quot;:&quot;v4.3 (Jelly Bean)&quot;,&quot;Type&quot;:&quot;Smart Phones&quot;,&quot;RAM&quot;:&quot;8 GB&quot;,&quot;Resolution&quot;:&quot;720 x 1280 Pixel&quot;,&quot;CPU Speed&quot;:&quot;1.9 GHz&quot;,&quot;CPU&quot;:&quot;Quad Core&quot;,&quot;Megapixel&quot;:&quot;8 Megapixel&quot;,&quot;Screen Size&quot;:&quot;5.25 Inch&quot;,&quot;Bluetooth version&quot;:&quot;v4.0&quot;,&quot;Processor Type&quot;:&quot;1.2 GHz Quad-core&quot;}', NULL, 1),
