(3349, 1247, 1, 'Samsung 40-Inch Full HD LED TV UA40F5000', 'Real entertainment reaches a greater level with resolution, twice as high as standard HD TVs. With Samsung Smart TV, breathtaking view takes you beyond the screen and immerses into a new world. The Full HD images with a rich and vivid texture take movies and your favourite TV programs to a whole new level. It brings the experience of reality to a different dimension altogether.\n\n', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;40 Inch&quot;,&quot;Warranty&quot;:&quot;1 year&quot;,&quot;Series&quot;:&quot;5 Series&quot;,&quot;Display&quot;:&quot;40 inch&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Resolution&quot;,&quot;Design&quot;:&quot;Logo Deco , Slim 1, NNB Bezel Type , Black Front Colour , Swivel (Left \\/ Right) , Quad Stand&quot;,&quot;Power&quot;:&quot;AC100 - 240V 50 \\/ 60Hz Power Supply&quot;,&quot;Dimension without stand&quot;:&quot;1,059.6 x 626.2 x 49.4mm&quot;,&quot;Dimension with stand&quot;:&quot;1,059.6 x 700.0 x 307.3mm&quot;,&quot;Weight without stand&quot;:&quot;10.8Kg&quot;,&quot;Item EAN&quot;:&quot;2724274181392&quot;}', NULL, 1),
