(3351, 1248, 1, 'Samsung Smart 46-Inch Full HD LED TV UA46F8000', 'The Samsung 46 Inch Smart 3D Full HD LED TV 46F8000 is an elegant TV that provides you with the ultimate viewing experience. With this Smart TV, you can explore online content as well as enjoy personal viewing recommendations. It''s Smart Interaction feature allows you to change channels and do a lot more using simple gesture and voice commands. It features a Twin Tuner TV technology which lets you watch one channel on your TV while someone else enjoys another on a different device. With Smart Evolution, you can renew your Samsung Smart TV using the latest technology, to get the optimum performance.\n\n', '{&quot;Brand&quot;:&quot;Samsung&quot;,&quot;Screen Size&quot;:&quot;46 Inch&quot;,&quot;Warranty&quot;:&quot;1 year&quot;,&quot;Series&quot;:&quot;5 Series&quot;,&quot;Display&quot;:&quot;46 inch&quot;,&quot;Resolution&quot;:&quot;1920 x 1080 Resolution&quot;,&quot;Design&quot;:&quot;Logo Deco , Slim 1, NNB Bezel Type , Black Front Colour , Swivel (Left \\/ Right) , Quad Stand&quot;,&quot;Power&quot;:&quot;AC100 - 240V 50 \\/ 60Hz Power Supply&quot;,&quot;Dimension without stand&quot;:&quot;1,059.6 x 626.2 x 49.4mm&quot;,&quot;Dimension with stand&quot;:&quot;1,059.6 x 700.0 x 307.3mm&quot;,&quot;Weight without stand&quot;:&quot;10.8Kg&quot;,&quot;Item EAN&quot;:&quot;2724274181392&quot;}', NULL, 1),
