(3387, 1218, 1, 'Sony Xperia S LT26I (32GB, WiFi 3G, White)', 'Sporting an elegant white finish, the Xperia S LT26I from Sony is a smartphone you would love to own. It features a heady blend of looks with performance. Packed inside its sleek body is a 1.5GHz Qualcomm Dual Core processor with 1GB RAM. This combination helps the phone tackle even the most complex task with great ease, ensuring that all your applications run without any glitches. Boasting a 4.3inch Reality display with the acclaimed Mobile BRAVIA engine, the Xperia S enhances your gaming and movie experience. This display has a resolution of 1280 x 720p and is capable of rendering images with more than 16.7 million colors. For always staying connected with family and friends over the Internet, you can use a WiFi or 3G network. The storage capacity if 32GB provides you with enough space to store your favorite tracks, movies, TV shows, and more.\n\n', '{&quot;Brand&quot;:&quot;Sony&quot;,&quot;Color&quot;:&quot;White&quot;,&quot;Networking&quot;:&quot;LTE 1, 3, 5, 7, 8, 20&quot;,&quot;Resolution&quot;:&quot;480 x 800 &quot;,&quot;Storage Capacity&quot;:&quot;8 GB&quot;,&quot;Width&quot;:&quot;69.17 mm&quot;,&quot;CPU Speed&quot;:&quot;2.3 GHz&quot;,&quot;Phone camera&quot;:&quot;13 Megapixel&quot;,&quot;User Interface&quot;:&quot;Touch&quot;,&quot;Video Formats&quot;:&quot;MP4, H.264, H.263&quot;,&quot;Hard Disk Capacity&quot;:&quot;16 GB&quot;,&quot;SIM Type&quot;:&quot;Micro SIM&quot;,&quot;Operating System&quot;:&quot;Android&quot;}', NULL, 1),
