(3432, 1273, 1, 'Samsung Galaxy S3 Neo GT-I9300I Dual SIM (16GB, 3G + Wifi, Marble White)', 'Balance comfort with luxury with Samsung Galaxy S3 Neo. This phone houses two SIM cards and runs on the intuitive Android operating system. The Super AMOLED screen of this 3G phone adds clarity and presents images free from flaws. The 1.4GHz quad core CPU processes requests at a faster rate and makes your multimedia and gaming experience an enjoyable one. Bluetooth 4.0 helps to transfer files easily to many different compatible electronic devices. WiFi connectivity enables you to access the Internet via a WiFi hotspot. A resolution of HD 1280 x 720 pixels will keep your spirit overflowing with interest, so that you are glued to the phone for a long time. This phone is marble white in color and sports a smooth finish.', '{&quot;Brand&quot;:&quot;SAMSUNG&quot;,&quot;Color&quot;:&quot;Marble White&quot;,&quot;Type&quot;:&quot;Smartphone&quot;,&quot;OS&quot;:&quot;Android&quot;,&quot;Depth&quot;:&quot;8.6 mm&quot;,&quot;Width&quot;:&quot;70.8 mm&quot;,&quot;RAM&quot;:&quot;1.5 GB &quot;,&quot;CPU&quot;:&quot;Quad core&quot;}', '', 1),
(3433, 1277, 1, 'HP Scanjet G3110 Photo Scanner ', 'Enjoy easy scanning at the touch of a button with this stylish, affordable scanner. Get great results from your photos, slides and negatives, then enhance or restore them using intuitive software. Scan and manage documents for easy archiving too.\n\nFEATURES\n\nGet more from your photos with high-quality scanning and easy restoration.\nScan multiple photos, slides, negatives or even 3-D objects and save to separate files.\nTurn paperwork into editable documents and easy-to-archive digital files.', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 2400 dpi&quot;,&quot;Bit depth&quot;:&quot;48-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;373 x 274 x 44.5 mm&quot;,&quot;Weight&quot;:&quot;2.9 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', '', 1),
(3434, 1278, 1, 'HP Scanjet 3000s2 SheetFed Scanner ', 'Scan business documents from your desktop, using a fast, reliable, sheet-feed scanner. Scan two-sided documents at up to 20 pages per minute, using the 50-page automatic document feeder, and catch misfed pages with ultrasonic double-feed detection.\n\nFEATURES\n\nDigitize documents with fast, two-sided scanning\nScan up to 20 ppm/40 ipm at 300 dpi in black and white, grayscale and color.\nScan up to 50 pages at a time while tending to other projectsâ€”just press Scan and walk away\nEasily convert your hard copies to digital files\nScan with the touch of a button\nIntegrates with leading content management applications using the TWAIN software driver\nCapture all the detail and fine print at up to 600 dpi scanning resolution\nScan in different file formatsâ€”PDF, TIFF, JPEG, Microsoft Wordâ€”and save disk space with smaller file sizes\nReliably scan every page of your document, using ultrasonic double-feed detection\nTackle a variety of paper types, thicknesses and sizes reliably\nRely on this scanner to work hard for you every day with a duty cycle of up to 1000 pages per day', '{&quot;Brand&quot;:&quot;HP&quot;,&quot;Scanner Type&quot;:&quot;Flatbed&quot;,&quot;Scan Resolution optical&quot;:&quot;Up to 2400 dpi&quot;,&quot;Bit depth&quot;:&quot;48-bit&quot;,&quot;Levels of grayscale&quot;:&quot;256&quot;,&quot;Power consumption&quot;:&quot;25 watts maximum&quot;,&quot;Dimension&quot;:&quot;373 x 274 x 44.5 mm&quot;,&quot;Weight&quot;:&quot;2.9 kg&quot;,&quot;Scan size&quot;:&quot; 8.5 x 12.3 in&quot;}', '', 1),
(3435, 1279, 1, 'Nikon CoolPix S3500 ', 'The CoolPix S3500 from Nikon comes in a sleek and lightweight body that sports a contemporary silver finish. It is capable it delivering images with exquisite detail and clarity thanks to the advanced 20.1MP 1/2.3inch CCD sensor and the 26 to 182mm (35mm equivalent) NIKKOR ED wide angle to telephoto glass lens. An aperture range of 3.4 to 6.4 lets you shoot clear images even in varying lighting conditions. Whether itâ€™s about capturing the joy of a bright sunny day or the mysticism of a candle in the dark, your camera is always ready to go with minimum adjustments.', '{&quot;Brand&quot;:&quot;Nikon&quot;,&quot;Color&quot;:&quot;Silver&quot;,&quot;Product weight&quot;:&quot;690&quot;,&quot;Resolution&quot;:&quot;540 x 960 &quot;,&quot;Storage Capacity&quot;:&quot;8 GB&quot;,&quot;Width&quot;:&quot;69.17 mm&quot;,&quot;Megapixel&quot;:&quot;16.2 MP&quot;}', '', 1),
(3436, 1280, 1, 'Samsung Galaxy S3 Neo GT-I9300I', 'Balance comfort with luxury with Samsung Galaxy S3 Neo. This phone houses two SIM cards and runs on the intuitive Android operating system. The Super AMOLED screen of this 3G phone adds clarity and presents images free from flaws. The 1.4GHz quad core CPU processes requests at a faster rate and makes your multimedia and gaming experience an enjoyable one. Bluetooth 4.0 helps to transfer files easily to many different compatible electronic devices. WiFi connectivity enables you to access the Internet via a WiFi hotspot. A resolution of HD 1280 x 720 pixels will keep your spirit overflowing with interest, so that you are glued to the phone for a long time. This phone is marble white in color and sports a smooth finish.', '{&quot;Brand&quot;:&quot;SAMSUNG&quot;,&quot;Color&quot;:&quot;Marble White&quot;,&quot;Type&quot;:&quot;Smartphone&quot;,&quot;OS&quot;:&quot;Android&quot;,&quot;Depth&quot;:&quot;8.6 mm&quot;,&quot;Width&quot;:&quot;70.8 mm&quot;,&quot;RAM&quot;:&quot;1.5 GB &quot;,&quot;CPU&quot;:&quot;Quad core&quot;}', '', 1),
